INSERT INTO "all_names" VALUES (54111,'Ali','O''g''il bolalar ismi','Eng yuksak, eng ulug'', yuqori martabali.','Arabcha');
INSERT INTO "all_names" VALUES (54112,'Bek','O''g''il bolalarga','Hukmdor, hokim, boshqaruvchi,','O''zbekcha');
INSERT INTO "all_names" VALUES (54113,'Beka','Qiz bolalar ismi','Beklar avlodiga mansub  aslzoda qiz,ayol.','O''zbekcha');
INSERT INTO "all_names" VALUES (54114,'Berdi','O''g''il bolalar ismi','Ali bergan bola yoki alining tuhfasi, sovg''asi','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (54115,'Bibi','Qiz bolalar ismi','Xonim, beka, oyim ya`ni yuqori tabaqaga mansub ayol. bu so''z o''tmishda mashhur turk ayollarining faxriy unvoni bo''lgan va xonim, beka, uy sohibasi ma’nolarini anglatgan. o''zbek shevalarida bibi - buvi, ona, qaynona, manolarini anglatadi, qizlar ismining birinchi, ikkinchi qismida kelib hurmat, erkalash munosabatlarini hamda qiz, qiz bola ma`nosini anglatadi','O''zbekcha, hindcha');
INSERT INTO "all_names" VALUES (54116,'Bonu','Qiz bolalar ismi','Shoh (sulton)lar, aslzodalar nasliga mansub qiz yoki beka, xonim, begim','Fors-tojikcha');
INSERT INTO "all_names" VALUES (54117,'Boy','O''g''il bolalarga','Davlatli, badavlat yoki hukmron, hukm. boy so''zi bilan boshlangan qo''shma ismlarning (boymurod, boymuhammad, boynazar ) qisqargan shakli','O''zbekcha');
INSERT INTO "all_names" VALUES (54118,'Din','O''g''il bolalar ismi','Muhammad (s.a.v.)ning dini (islom) farzandi. ahmad-muhammad payg''ambarning sifatlaridan biridir','Arabcha');
INSERT INTO "all_names" VALUES (54119,'Gul','Qiz bolalar ismi','Guldek chiroyli, go''zal yoki umri guldek yashnoq bo''lsin. tarkibida gul so''zi mavjud ismlarning qisqargan shakli','Fors-tojikcha');
INSERT INTO "all_names" VALUES (54120,'Ibn','O''g''il bolalarga','Mangu o''g''il, boqiylik farzandi, mangu umr ko''ruvchi','Arabcha');
INSERT INTO "all_names" VALUES (54121,'Jamol','O''g''il yoki qiz bolalarga','Chiroyli, zebo va yuksak martabali qiz','Arabcha, hindcha');
INSERT INTO "all_names" VALUES (54122,'Jon','O''g''il va qiz bolalarga','Qalbga nur eltuvchi, yurakni yayratuvchi, jonga huzur bag''ishlovchi qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (54123,'Mir','O''g''il bolalar ismi','Amir so''zining qisqargan shakli. ma’nosi rais, sayid, boshliq.','Arabcha');
INSERT INTO "all_names" VALUES (54124,'Mirza','O''g''il bolalar ismi','Ulg''ayib o''qimishli, savobxon yigit bo''lsin.','Fors-tojikcha');
INSERT INTO "all_names" VALUES (54125,'Muhammad','O''g''il bolalarga','Maqtovga, olqishlarga sazovor. ko''pincha muhammad (s.a.v) ga nisbat beriladi. bu ism  bilan boshlangan ismlarning to''liq ma''nosi bilan tanishish uchun qo''llanmaga qarang muhammad','Arabcha');
INSERT INTO "all_names" VALUES (54126,'Murod','O''g''il bolalar ismi','Murod-maqsadli yoki orzu qilingan, qumsalgan bola.','Arabcha');
INSERT INTO "all_names" VALUES (54127,'Nazar','O''g''il bolalar ismi','Allohning yoki avliyolarning nazari, muruvvati bilan tug''ilgan bola, alloh nazar qilgan bola.','Arabcha');
INSERT INTO "all_names" VALUES (54128,'Niyoz','O''g''il yoki qiz bolalarga','1) allohdan so''rab, iltijo qilib olingan bola; 2) muhtoj bo''lib, armon va orzu bilan erishilgan bola; 3) allohning marhamati, ehsoni tuhfasi','Arabcha');
INSERT INTO "all_names" VALUES (54129,'Oy','Qiz bolalarga','Oydek buyuk, yuksak va ulug''vor bola yoki oydek suluv bola','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (54130,'Qul','O''g''il bolalarga','Qul so''zi bilan boshlangan va oxirida qul so''zi qo''shilgan qo''shma ismlarning (qulmuhammad, muhammadqul) qisqargan shakli. qul - xizmatchi, tobe, banda yoki  erksiz. batavsil ma''lumot uchun qo''llanmaga qarang. qul','O''zbekcha');
INSERT INTO "all_names" VALUES (54131,'Said (Sayid)','O''g''il bolalar ismi','Baxtli, saodatli, omadli yoki tolei baland, o''suvchi, yuksaluvchi. said yoki sayid ismi haqidagi ma''lumot uchun qo''llanmaga qarang. said','Arabcha');
INSERT INTO "all_names" VALUES (54132,'Sayid','O''g''il bolalar ismi','Sayidlar naslidan bo''lgan qiz','Arabcha');
INSERT INTO "all_names" VALUES (54133,'Xo''ja','O''g''il bolalar ismi','Aynan ma''nosi xo''jayin, sohib, janob yoki  muallim, ustoz. ismlarda qollanilish ma''nosi haqida ma''lumot olish uchun qo''llanmaga qarang. xo''ja','Arabcha');
INSERT INTO "all_names" VALUES (54134,'Xon','O''g''il va qiz bolalarga','Podshoh, hukmdor, hokim, ya’ni ulg''ayib ulug'' martabalar sohibi, elboshi bo''lsin.','O''zbekcha');
