INSERT INTO "all_names" VALUES (55181,'Bo''kay','O''g''il bolalar ismi','Botir, mard, qahramon','O''zbekcha');
INSERT INTO "all_names" VALUES (55182,'Bo''kayxon','O''g''il bolalar ismi','Qudratli, ulug'' xon','O''zbekcha');
INSERT INTO "all_names" VALUES (55183,'Bokira','Qiz bolalar ismi','Iffatli, ma’suma, pokiza qiz','Arabcha');
INSERT INTO "all_names" VALUES (55184,'Bolabek','O''g''il bolalar ismi','Beklar nasliga mansub bola.','O''zbekcha');
INSERT INTO "all_names" VALUES (55185,'Bo''lak','O''g''il bolalar ismi','Sovg''a, ehson, had’ya yoki bu boshqa bola. chaqaloqning dushmanlarini chalg''itish uchun beriladigan ism','O''zbekcha');
INSERT INTO "all_names" VALUES (55186,'Bo''lakbeka','Qiz bolalar ismi','Tuhfa, sovg''a qilingan qiz yoki bu oldingilardan boshqa, o''lmaydigan, yashaydigan qiz','O''zbekcha');
