INSERT INTO "all_names" VALUES (55188,'Bo''lakboy','O''g''il bolalar ismi','Tuhfa, sovg''a qilib berilgan bola boy, badavlat bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (55189,'Bo''lakqul','O''g''il bolalar ismi','Allohning yashovchi, barhayot bo''luvchi bandasi','O''zbekcha');
INSERT INTO "all_names" VALUES (55190,'Bolamurod','O''g''il bolalar ismi','Murod-maqsadli bola yoki murodimiz hosil bo''lgan bola','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55191,'Bo''lar','O''g''il bolalar ismi','Tarkibida bo''lar so''zi kelgan ismlarning qisqargan shakli yoki bo''lar, yetar ma’nolarida ota-onalarning farzandli bo''lishdan qoniqqanligini ifoda etadi.','O''zbekcha');
INSERT INTO "all_names" VALUES (55192,'Bolato''q','O''g''il bolalar ismi','Muhtojsiz, to''q, nasibasi butun bo''lib o''tsin','O''zbekcha');
INSERT INTO "all_names" VALUES (55193,'Bolbek','O''g''il bolalar ismi','Beklar avlodiga mansub, asaldek shirin, suyukli','O''zbekcha');
INSERT INTO "all_names" VALUES (55194,'Bo''lbek','O''g''il bolalar ismi','Omon bo''lsin, tursin, yashasin yoki omon bo''luvchi va berk, mahkam bola','O''zbekcha');
