INSERT INTO "all_names" VALUES (55199,'Bolchuchuk','Qiz bolalar ismi','Boldek shirin, suyukli qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (55200,'Bolda','Qiz bolalar ismi','Zamin, o''lka (ona yer, ona tuproq) farzandi','Arabcha');
INSERT INTO "all_names" VALUES (55201,'Bo''ldi','Qiz bolalar ismi','Tarkibida bo''ldi so''zi mavjud ismlarning qisqargan shakli yoki ota-onalarning qiz yetarli bo''ldi degan fikrini ifodalaydi.','O''zbekcha');
INSERT INTO "all_names" VALUES (55202,'Boldono','Qiz bolalar ismi','Boldek shirin, aqlli, dono qiz','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (55203,'Bolg''a','O''g''il bolalar ismi','Bolg''adek mahkam, mustahkam bola yoki akasi boltaboyning ukasi bolg''aboy bo''lsin','O''zbekcha');
