INSERT INTO "all_names" VALUES (55206,'Bolgul','Qiz bolalar ismi','Gulning boldek shirin, yoqimtoy qiz yoki boldek shirin va guldek ko''rkam qiz','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (55207,'Boli','O''g''il bolalar ismi','O''suvchi, u’lg''ayuvchi, yashovchi bola','Fors-tojikcha');
INSERT INTO "all_names" VALUES (55208,'Bolida','Qiz bolalar ismi','Barhayot, o''sib-unuvchi, ulga’yuvchi, o''lmaydigan qiz','Fors-tojikcha');
INSERT INTO "all_names" VALUES (55209,'Bolig''','O''g''il bolalar ismi','Balog''atga yetsin, ulg''aysin','Arabcha');
INSERT INTO "all_names" VALUES (55210,'Bolig''a','Qiz bolalar ismi','Sog'' ulg''ayib barkamol qiz bo''lsin','Arabcha');
