INSERT INTO "all_names" VALUES (55213,'Bo''lish','O''g''il bolalar ismi','Bo''lishgin, ko''maklashgin, yordam qilgin (allohga murojaatni anglatadi),ya’ni bolaning so''g yashab ketishiga ko''mak bergin ma''nosida','O''zbekcha');
