INSERT INTO "all_names" VALUES (55215,'Boljon','Qiz bolalar ismi','Asaldek shirin,yoqimli, qadrli qiz','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (55216,'Bolli','O''g''il bolalar ismi','Asal kabi totli, suyuki, shirin tilli bola','O''zbekcha');
INSERT INTO "all_names" VALUES (55217,'Bolliturdi','O''g''il bolalar ismi','Shirintoy, suyukli bola sog'' bo''lsin, tursin yoki sog''-salomat unib-o''ssin','O''zbekcha');
INSERT INTO "all_names" VALUES (55218,'Bolmat','O''g''il bolalar ismi','Boldek shirin o''g''ilni muhammad (s.a.v.) qo''llasin','O''zbekcha, arabcha');
