INSERT INTO "all_names" VALUES (55227,'Bolqo''zi','O''g''il bolalar ismi','Bordek shirin, qoylar qo''zilayotganda tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (55228,'Bolqul','O''g''il bolalar ismi','Boldek shirin, suyukli o''g''il','O''zbekcha');
