INSERT INTO "all_names" VALUES (55252,'Bolyor','Qiz bolalar ismi','Gulning bolidek shirin, yoqimtoy qiz yoki boldek shirin va guldek ko''rkam qiz','O''zbekcha, fors-tojikcha');
