INSERT INTO "all_names" VALUES (55441,'Bulbul','Qiz bolalar ismi','Shirin tilli, so''zga chechan, notiq,','Fors-tojikcha');
INSERT INTO "all_names" VALUES (55442,'Bulbulniso','Qiz bolalar ismi','Shirin tilli ayol, ko''rkam, xushovoz qiz','Fors-tojikcha, arabcha');
INSERT INTO "all_names" VALUES (55443,'Buloq','Qiz bolalar ismi','Hayoti chashmadek tiniq va davomli bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (55444,'Bulutbek','O''g''il bolalar ismi','Bulutli kunda tug''ilgan yoki bulut (bolut, dub) daraxtidek mustahkam bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (55445,'Bunyod','O''g''il bolalar ismi','Asos, yaralgan, ushalgan orzu','Fors-tojikcha');
INSERT INTO "all_names" VALUES (55446,'Burchoq','O''g''il bolalar ismi','Yovvoyi no''xot (burchoq) dek mahkam, joni qattiq bo''lsin, ya’ni sog'' o''ssin, o''lmasin','O''zbekcha');
INSERT INTO "all_names" VALUES (55447,'Burg''un','O''g''il bolalar ismi','Burg''in - burgin, ya’ni qiz tug''ilishidan o''g''il bola tug`ilishiga qarab burilsin degan tilak bilan berilgan','O''zbekcha');
INSERT INTO "all_names" VALUES (55448,'Burgut','O''g''il bolalar ismi','Burgutdek kuchli, olg''ir va chaqqon bo''lsin yoki burgut qabilasiga mansub bola','O''zbekcha');
INSERT INTO "all_names" VALUES (55449,'Burgutali','O''g''il bolalar ismi','Burgutdek kuchli, olg''ir ,dovyurak va jasur  bo''lsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55450,'Burgutoy','Qiz bolalar ismi','Kuchli, jasur qiz bo''lsin yoki burgut qabilasiga mansub qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (55451,'Burhon','O''g''il bolalar ismi','Burhoniddin ismining qisqargan shakli. qar. burhoniddin','Arabcha');
INSERT INTO "all_names" VALUES (55452,'Burhonali','O''g''il bolalar ismi','Ali muhofaza qiluvchi, asrovchi bola','Arabcha');
INSERT INTO "all_names" VALUES (55453,'Burhoniddin','O''g''il bolalar ismi','Dinning dalili, asosi, shahodati yoki din qo''riqchisi, dinni dalillovchi. o''rta asr hukmdorlari o''zlarini burxoniddin - dinning himoyachisi, dinni asrovchi deb yuritishgan va bu so''z ularning faxriy unvoni bo''lgan','Arabcha');
INSERT INTO "all_names" VALUES (55454,'Buril','Qiz bolalar ismi','Burilgan, ya’ni oilada qiz tug''ilarverishdan o''g''il bola tug''ilishiga tomon burilsin, keyingisi o`g`il bo`lsin.','O''zbekcha');
INSERT INTO "all_names" VALUES (55455,'Burma','Qiz bolalar ismi','Kokilli, tojdor qiz yoki burma (binafsha)dek ko''rkam qiz.','O''zbekcha');
INSERT INTO "all_names" VALUES (55456,'Burnoq','O''g''il bolalar ismi','Yosh, navqiron yoki o''g''il tug''ilmagan oilalarda keyinchalik tug''ilgan o`g`ilni burni oq otga o`tkazib o`tkaziluvchi marosimdan keyin beriluvchi nom','O''zbekcha');
INSERT INTO "all_names" VALUES (55457,'Buroq','O''g''il bolalar ismi','Buroq otdek kuchli, to''zimli bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (55458,'Bursin','Qiz bolalar ismi','Qiz tug''ilgani yetar, endi o''g''il tug''ilishi tomon burilsin','O''zbekcha');
INSERT INTO "all_names" VALUES (55459,'Burundiq','O''g''il bolalar ismi','Burundiq bilan mahkamlangan, bog''langan, ya’ni mustahkamlangan, yashaydigan','O''zbekcha');
INSERT INTO "all_names" VALUES (55460,'Busalom','Qiz bolalar ismi','Buvisi ismini olgan qiz salomat bo''lsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55461,'Busobira','Qiz bolalar ismi','Buvisi ismi bilan nomlangan qiz chidamli, sabrli bo''lsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55462,'Butoq','O''g''il bolalar ismi','Daraxt butalaridek o''ssin, ulg''aysin yoki farzandlarimiz daraxt butoqlaridek ko''paysin','O''zbekcha');
INSERT INTO "all_names" VALUES (55463,'Butun','O''g''il bolalar ismi','Umri to''la, butun qilib berilgan bo''lsin, yashasin, o''lmasin','O''zbekcha');
INSERT INTO "all_names" VALUES (55464,'Buva','O''g''il bolalar ismi','Buvasining yoki katta bobosining ismi berilgan bola.','O''zbekcha');
INSERT INTO "all_names" VALUES (55465,'Buvachol','O''g''il bolalar ismi','Buvasining ismini olgan bolaning umri uzoq bo''lsin','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (55466,'Buvak','O''g''il bolalar ismi','Chaqaloq,  go''dak, norasida','Fors-tojikcha');
INSERT INTO "all_names" VALUES (55467,'Buvamirza','O''g''il bolalar ismi','Buvasi (bobosi)ning nomi berilgan bola o''qimishli, bilimli yigit bo''lsin','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (55468,'Buvamuhammad','O''g''il bolalar ismi','Bobosining ismi berilgan o''g''ilni muhammad (s.a.v.) qo''llasin','O''zbekcha, arabcha');
