INSERT INTO "all_names" VALUES (55473,'Buvasl','Qiz bolalar ismi','Buvisining ismi qo''yilgan asl, pokiza qiz','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55474,'Buvayda','Qiz bolalar ismi','Buvaydada tug''ilgan qiz, buvayda farzandi','O''zbekcha');
