INSERT INTO "all_names" VALUES (55484,'Buvish','Qiz bolalar ismi','Beka, xonim yoki tarkibida buvi so''zi bo''lgan qo''shma ismlarning qisqargan shakli','O''zbekcha');
INSERT INTO "all_names" VALUES (55485,'Buvisuluv','Qiz bolalar ismi','Buvisining ismi bilan yuritilgan go''zal qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (55486,'Buvitoy','Qiz bolalar ismi','Buvisining ismini olgan, suyukli, erkatoy qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (55487,'Buviziyoda','Qiz bolalar ismi','Qizlar yetarli bo''ldi, keyingisi o''g''il bo''lsin yoki badanida ortiqcha belgisi bor qiz','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55488,'Buvjamol','Qiz bolalar ismi','Buvisi ismi berilgan ko''rkam, zebo qiz','O''zbekcha, arabcha');
