INSERT INTO "all_names" VALUES (55492,'Buvolim','Qiz bolalar ismi','Buvisining nomi berilgan qiz bilimdon, olima bo''lsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55493,'Buvoliya','Qiz bolalar ismi','Buvisining ismi bilan atalgan oliy nasab farzand, aslzoda qiz','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55494,'Buvo''roz','Qiz bolalar ismi','Buvisining nomi berilgan baxtli qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (55495,'Buvqora','Qiz bolalar ismi','Buvisining ismi bilan atalgan kuchli, jasur qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (55496,'Buvsa’di','Qiz bolalar ismi','Baxtli, saodatmand qiz','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55497,'Buvsaida','Qiz bolalar ismi','Buvisining nomi bilan atalgan baxtli qiz','O''zbekcha, arabcha');
