INSERT INTO "all_names" VALUES (55499,'Buvsanam','Qiz bolalar ismi','Buvisining ismi berilgan go''zal qiz','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55500,'Buvsaodat','Qiz bolalar ismi','Buvisi ismini olgan baxtli qiz','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55501,'Buvsharaf','Qiz bolalar ismi','Buvisi ismini olgan yoqimtoy, totli qiz','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (55502,'Buvshirin','Qiz bolalar ismi','Buvisi ismi berilgan yoqimtoy, totli qiz','O''zbekcha, fors-tojikcha');
