INSERT INTO "all_names" VALUES (55514,'Buxor','O''g''il bolalar ismi','Buxoro shahrida tug''ilgan yoki tavalludi qandaydir o''sha shahar bilan aloqador bo''lgan bola.','Qadimiy sanskritcha');
