INSERT INTO "all_names" VALUES (55519,'Chag''aboy','O''g''il bolalar ismi','Bola, bolacha, norasida','O''zbekcha');
INSERT INTO "all_names" VALUES (55520,'Chag''ir','O''g''il bolalar ismi','Shag''al, mayda toshdek mustahkam bo''lsin yoki chag''ir urug''i (qongirot qabilasi tarkibida) ga mansub bola, yohud chag`ir ko`zli, kulrang kozli bola','O''zbekcha');
INSERT INTO "all_names" VALUES (55521,'Chag''ona','Qiz bolalar ismi','Xushovoz, shirintil, xushkalom, yoqimtoy dilkash qiz','Fors-tojikcha');
INSERT INTO "all_names" VALUES (55522,'Chag''ri','O''g''il bolalar ismi','Lochindek ziyrak, baquvvat bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (55523,'Chakan','O''g''il bolalar ismi','Ko''k, moviy ko''zli bola yoki chakan-cho''kich (boltadek) mustahkam','O''zbekcha');
INSERT INTO "all_names" VALUES (55524,'Chalabi','O''g''il bolalar ismi','Alloh, tangri ato qilgan bola yoki shahzoda, hukmron','O''zbekcha');
INSERT INTO "all_names" VALUES (55525,'Chalaboy','O''g''il bolalar ismi','Muddatiga yetmasdan chala tug''ilan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (55526,'Chalamurod','O''g''il bolalar ismi','Muddatidan avval tug''ilgan bola ulg''ayib murod-maqsadiga yetsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (55527,'Chaman','Qiz bolalar ismi','Hayoti, gulzor, o''tloqdek yashnoq bo''lsin yoki ko''rkam, zebo qiz yohud chamand - o''jar, qaysar qiz.','Fors-tojikcha');
INSERT INTO "all_names" VALUES (55528,'Chaman','Qiz bolalar ismi','Hayoti gulzordek yashnagan, baxtiyor bo''lsin yoki ilk bahorda tug''ilgan qiz','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (55529,'Chamanbibi','Qiz bolalar ismi','Hayoti chamandek yashnagan, baxtiyor qiz','Fors-tojikcha, o''zbekcha, hindcha');
INSERT INTO "all_names" VALUES (55530,'Chamanbuvi','Qiz bolalar ismi','Go''zal, sohibjamol qiz','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (55531,'Chamangul','Qiz bolalar ismi','Gullar chamanidek zebo qiz, chamanzordek yashnoq, go''zal qiz','Fors-tojikcha');
