INSERT INTO "all_names" VALUES (55535,'Chaqqon','O''g''il bolalar ismi','Ildam, harakatcham, tezkor, g''ayratli','O''zbekcha');
INSERT INTO "all_names" VALUES (55536,'Chaqqonbo''l','O''g''il bolalar ismi','Ildam, harakatchan, mehnatkash, tolmas','O''zbekcha');
INSERT INTO "all_names" VALUES (55537,'Charos','Qiz bolalar ismi','Katta qora ko''zli qiz, ko''zlari charosdek chiroyli qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (55538,'Charxiboy','O''g''il bolalar ismi','Charxdek mustahkam va harakatda bo''lsin yoki jahon, olam farzandi','Fors-tojikcha');
INSERT INTO "all_names" VALUES (55539,'Charxin','O''g''il bolalar ismi','Charxin (tuman nomi) farzandi, charxinda tug''ilgan','O''zbekcha');
INSERT INTO "all_names" VALUES (55540,'Chashma','Qiz bolalar ismi','Hayoti buloq suvidek mustafo hamda davomli bo''lsin.','Fors-tojikcha');
INSERT INTO "all_names" VALUES (55541,'Chavandoz','O''g''il bolalar ismi','Otda yaxshi chopuvchi, epchil, chavandoz yigit bo''lsin','Fors-tojikcha');
