INSERT INTO "all_names" VALUES (55557,'Chil','O''g''il bolalar ismi','Kulrang kaklik yoki bulduruq','O''zbekcha');
INSERT INTO "all_names" VALUES (55558,'Chilangar','O''g''il bolalar ismi','Temirchi, usta','Fors-tojikcha');
