INSERT INTO "all_names" VALUES (57178,'Ibrohim','O''g''il bolalar ismi','Bibliyadagi abraam ismining arabcha shakli bo''lib, xalqlar otasi ma’nosini anglatadi. rivoyatlarga ko''ra, ibrohimning ishoq va ismoil degan o''g''illari bolgan. ishoqdan yahudiy xalqi, ismoildan esa arablar tarqalgan','Qadimiy yahudiy');
