INSERT INTO "all_names" VALUES (57184,'Idris','O''g''il bolalar ismi','O''quvchi, o''rganuvchi, tirishqoq, bilimdon. idris payg''ambar o''qishda tirishqoqligi tufayli mana shunday nom (laqab) olgan. demak, idris - tirishqoq, g`ayratli bola','Qadimiy yahudiycha');
