INSERT INTO "all_names" VALUES (57232,'Ilminoz','Qiz bolalar ismi','Go''zallik, nafosat, nazokat ilmi sohibasi','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57233,'Ilminur','Qiz bolalar ismi','Ilm nuri, ilm ziyosi, ilm beruvchi, ilm baxsh etuvchi baxt','Arabcha');
INSERT INTO "all_names" VALUES (57234,'Ilmirahim','O''g''il bolalar ismi','Allohning ilmi yoki rahm-shafqat, muruvvat ilmi','Arabcha');
INSERT INTO "all_names" VALUES (57235,'Ilmisuluv','Qiz bolalar ismi','Go''zallik, nafosat ilmi','Arabcha, o''zbekcha');
