INSERT INTO "all_names" VALUES (57247,'Iltifot','Qiz bolalar ismi','Lutf, karam,yaxshilik yoki mehru shafqat, marhamat','Arabcha');
INSERT INTO "all_names" VALUES (57248,'Iltijoxon','Qiz bolalar ismi','Umid qilib, o''tinib, iltijo qilib erishilgan','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57249,'Iltimos','Qiz bolalar ismi','Allohdan so''rab, o''tinib olingan bola','Arabcha');
INSERT INTO "all_names" VALUES (57250,'Ilyos','O''g''il bolalar ismi','Aynan: mening tangrim yeliyaxin (yax’yo) allohning kuchi, qudrati yoki xalqlarning sevimligi, kishilar qadrlovchi, ezozlovchi odam. obihayot ichib xizr kabi mangu tirik deb faraz qilinadigan payg''ambarning nomi. quruqda xizr bo''lsa, suvlikda ilyos kishilarning madadkori, hamrohi deb hisoblanadi','Qadimiy yahudiycha');
INSERT INTO "all_names" VALUES (57251,'Ilyosiddin','O''g''il bolalar ismi','Ilyosning dini, imoni, e’tiqodi','Qadimiy yahudiycha, arabcha');
INSERT INTO "all_names" VALUES (57252,'Ilyosqul','O''g''il bolalar ismi','Ilyos payg''ambarning quli, xizmatkori','Qadimiy yahudiycha, o''zbekcha');
INSERT INTO "all_names" VALUES (57253,'Imdodulla','O''g''il bolalar ismi','Allohning ko''magi, yordami, marhamati','Arabcha');
INSERT INTO "all_names" VALUES (57254,'Imod','O''g''il bolalar ismi','Tayanch, suyanchiq, tirgak, madad, yordam','Arabcha');
INSERT INTO "all_names" VALUES (57255,'Imodali','O''g''il bolalar ismi','Ali ato qilgan suyanch, madad yoki alining ko''magi tufayli erishilgan bola','Arabcha');
