INSERT INTO "all_names" VALUES (57258,'Imom','O''g''il bolalar ismi','Aynan: oldinda turuvchi, peshvo yoki  masjidda oldinda turib namozni boshqaruvchi, musulmonlarning diniy rahbari, peshvosi. imom so''zi alining avlodlari hisoblanuvchi va shiitlar mazhabiga mansub kishilarning vii-x asrlardan udum bo''lib kelgan unvonidir va u ushbu unvonga sazovor shaxsning ismiga qo''shib aytilgan: imomali kabi.','Arabcha');
INSERT INTO "all_names" VALUES (57259,'Imomali','O''g''il bolalar ismi','Ali oldinda turuvchi, rahbar, peshvodir. muhammad (s.a.v.)ning jiyani va kuyovi hazrati ali shialarning birinchi imomi hisoblanadi. shu sababli u imomali deb yuritilgan va bu nom kishilar ismiga ham o''tgan','Arabcha');
INSERT INTO "all_names" VALUES (57260,'Imombaxsh','O''g''il bolalar ismi','Imom ato qilgan, bergan bola','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57261,'Imombek','O''g''il bolalar ismi','Diniy peshvo, diniy rahbar','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57262,'Imomberdi','O''g''il bolalar ismi','Diniy peshvo, muqaddas avliyo ato qilgan bola','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57263,'Imombergan','O''g''il bolalar ismi','Diniy boshliq (peshvo) ato qilgan, erishtirgan bola. bu ism biror muqaddas qadamjoga ziyorat qilingach tug''ilgan bolaga beriladi','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57264,'Imomcha','O''g''il bolalar ismi','Madrasa talabasi, kelgusida imom bo''luvchi bola yoki imomlarning kichigi, kenjasi','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57265,'Imomiddin','O''g''il bolalar ismi','Din boshlig''i, din homiysi, din peshvosi, dinning sodiq xizmatkori','Arabcha');
INSERT INTO "all_names" VALUES (57266,'Imommuhammad','O''g''il bolalar ismi','Muhammad (s.a.v.)  kabi dinning peshvosi, sardori','Arabcha');
INSERT INTO "all_names" VALUES (57267,'Imommurod','O''g''il bolalar ismi','Imom ko''magi tufayli erishilgan orzu yoki imom ato qilgan bola ulg''ayib murod-maqsadiga yetsin','Arabcha');
INSERT INTO "all_names" VALUES (57268,'Imomnafas','O''g''il bolalar ismi','Imomning qudrati (nafasi) tegib erishilgan bola','Arabcha');
INSERT INTO "all_names" VALUES (57269,'Imomnazar','O''g''il bolalar ismi','Din peshvosining marhamati, iltifoti tufayli erishilgan bola, imomning ehsoni, tuhfasi','Arabcha');
INSERT INTO "all_names" VALUES (57270,'Imomniyoz','O''g''il bolalar ismi','Imomdan o''tinib, tilab, olingan bola yoki imom bergan tuhfa, ehson','Arabcha, fors-tojikcha');
