INSERT INTO "all_names" VALUES (57272,'Imomsaid','O''g''il bolalar ismi','Imom erishtirgan baxtli, tolei baland bola','Arabcha');
INSERT INTO "all_names" VALUES (57273,'Imomxo''ja','O''g''il bolalar ismi','Din peshvosi, din himoyachisi','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57274,'Imomxol','O''g''il bolalar ismi','Dinning xolli peshvosi, boshlig''i','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57275,'Imomyor','O''g''il bolalar ismi','Imom (diniy peshvoning) do''sti, hamrohi, yo''ldoshi yoki imom hamroh, yo''ldosh bo''luvchi, panohiga oluvchi bola','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57276,'Imomzoda','O''g''il bolalar ismi','Imomning farzandi, o''g''li yoki imomlar avlodiga mansub bola','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57277,'Imon','O''g''il bolalar ismi','Asli iymon. ishonch, e’tiqod, ishonish, sig''inish. iymon islom dinining asosiy shartlaridan biri bo''lib, bunda allohga, islom dini va muhammadga ishonch, e''tiqod ko''zda tutiladi. demak, iymon, e''tiqodli bola.','Arabcha');
INSERT INTO "all_names" VALUES (57278,'Imona','Qiz bolalar ismi','Ishonch, ishonish; e''tiqod; ibodat qilish, sig''inish; iymoni mustahkam','Arabcha');
INSERT INTO "all_names" VALUES (57279,'Imonali','O''g''il bolalar ismi','Imonli, e''tiqodli,allohni sevuvchi','Arabcha');
INSERT INTO "all_names" VALUES (57280,'Imonberdi','O''g''il bolalar ismi','Alloh bergan imon-e’tiqodli bola','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57281,'Imonkeldi','O''g''il bolalar ismi','Imon-e’tiqodli tilladek aziz, bebaho bola','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57282,'Imontilla','O''g''il bolalar ismi','Dinga e’tiqodli tilladek aziz, bebaho bola','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57283,'Imroh','O''g''il bolalar ismi','Do''stlik, birodarlik, o''rtoqlik','Arabcha');
INSERT INTO "all_names" VALUES (57284,'Imron','O''g''il bolalar ismi','Tiriklik, barhayotlik, uzoq umr ko''ruvchi','Arabcha');
