INSERT INTO "all_names" VALUES (57295,'Indira','Qiz bolalar ismi','Indu - oy demakdir. go''zallik, shuhrat buyuklik ma''nolarini ham bildiradi.  indira veda dinidagi iloha (xudo)lardan biri lakshmi ismining shakllaridan biri. u momaqaldiroq, yomg''ir xudosi hisoblanadi','Hindcha');
INSERT INTO "all_names" VALUES (57296,'Inimcha','O''g''il bolalar ismi','Ukacha, inicha yoki oldingi bolalarga ukacha bo''lib yursin','O''zbekcha');
INSERT INTO "all_names" VALUES (57297,'Inja','Qiz bolalar ismi','Jozibali, zarif, nozik, nafis, odobli, nazokatli, xushmuomala qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (57298,'Injagul','Qiz bolalar ismi','Nafis, nozik, zebo gul','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57299,'Inji','Qiz bolalar ismi','Jozibali, nozli, ishvali, nazokatli yoki tortiq, had’ya, inom','O''zbekcha');
INSERT INTO "all_names" VALUES (57300,'Inju','Qiz bolalar ismi','Marvarid, dur, javohir yoki xizmatchi, malay, cho''ri','O''zbekcha');
INSERT INTO "all_names" VALUES (57301,'Injubeka','Qiz bolalar ismi','Beklar naslidan bo''lgan durdek bebaho qiz yoki dur (marvariddek) bebaho ayol','O''zbekcha');
INSERT INTO "all_names" VALUES (57302,'Inkoroy','Qiz bolalar ismi','Allohga sig''inuvchi, xudojo''y, taqvodor ayol','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57303,'Inobat','Qiz bolalar ismi','Alloh maqbul topib bergan bola yoki allohning marhamati, himmati','Arabcha');
INSERT INTO "all_names" VALUES (57304,'Inobiddin','O''g''il bolalar ismi','Dinning marhamati, himmati, inobati','Arabcha');
INSERT INTO "all_names" VALUES (57305,'Inod','O''g''il bolalar ismi','O''jar, qaytmas, sarkash bola','Arabcha');
INSERT INTO "all_names" VALUES (57306,'Inog''om','O''g''il bolalar ismi','In’om, sovg''a, tuhfa, hadya','Arabcha');
INSERT INTO "all_names" VALUES (57307,'Inol','O''g''il bolalar ismi','Hokim, hukmron, podshoh yoki yalinib, yolg''orib erishilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (57308,'Inom','O''g''il bolalar ismi','In''om, tuxfa. ota onasiga olloh tomonidan berilgan in''om bo''lgan o''g''il','O''zbekcha');
INSERT INTO "all_names" VALUES (57309,'Inon','O''g''il bolalar ismi','Umid qilish, ishonish, inonish, ya’ni bola yashab ketadi deb umid qilinadi','O''zbekcha');
INSERT INTO "all_names" VALUES (57310,'Inonch','O''g''il bolalar ismi','Ishonish, umidlanish, ya’ni bolaning yashab ketishiga umid bog''lash','O''zbekcha');
INSERT INTO "all_names" VALUES (57311,'Inoq','O''g''il bolalar ismi','Do''st, o''rtoq, yo''ldosh yoki o''ziga mustaqil bolgan shaxs. buxoro va xiva xonligida eng yuqori mansablardan biri ham inoq deb yuritiladi','O''zbekcha');
INSERT INTO "all_names" VALUES (57312,'Inoyat','O''g''il bolalar ismi','Yordam, ko''mak, ehson','Arabcha');
INSERT INTO "all_names" VALUES (57313,'Inoyatali','O''g''il bolalar ismi','Alining himmati, ehsoni, ko''magi','Arabcha');
INSERT INTO "all_names" VALUES (57314,'Inoyatbibi','Qiz bolalar ismi','Allohning ehsoni, marhamatii bo''lgan baland martabali qiz','Arabcha, hindcha');
INSERT INTO "all_names" VALUES (57315,'Inoyatrasul','O''g''il bolalar ismi','Payg''ambarning lutfu karami, ko''magi bilan erishilgan bola','Arabcha');
INSERT INTO "all_names" VALUES (57316,'Inoyatulla','O''g''il bolalar ismi','Allohning marhamati, lutfu karami yoki allohning fikri, yodi. ushbu nom muhammad (s.a.v.)ning sifatlaridan biri bo''lgan','Arabcha');
INSERT INTO "all_names" VALUES (57317,'Inoyatxol','Qiz bolalar ismi','Allohning muruvvati, lutfu karami tufayli erishilgan xolli qiz','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57318,'Inqilob','O''g''il bolalar ismi','O''zgarish, to''ntarish. inqilob farzandi. yangi davrda paydo bo''lgan ism','Arabcha');
INSERT INTO "all_names" VALUES (57319,'Inqilobiya','Qiz bolalar ismi','Inqilob, o''zgarish, yangilanish qizi','Arabcha');
INSERT INTO "all_names" VALUES (57320,'Insof','O''g''il bolalar ismi','Halol,insofli, pokiza, adolatli.','Arabcha');
INSERT INTO "all_names" VALUES (57321,'Insofali','O''g''il bolalar ismi','Pokiza, adolatpesha bola','Arabcha');
INSERT INTO "all_names" VALUES (57322,'Insofiddin','O''g''il bolalar ismi','Dinning insofli, sabr-qanoatli farzandi','Arabcha');
INSERT INTO "all_names" VALUES (57323,'Inson','O''g''il bolalar ismi','Odam, kishi yoki odamshinavanda bola','Arabcha');
INSERT INTO "all_names" VALUES (57324,'Intiq','O''g''il bolalar ismi','Orziqib, intiq bo''lib kutilgan','O''zbekcha');
INSERT INTO "all_names" VALUES (57325,'Intiqom','O''g''il bolalar ismi','Oldingi vafot etrgan farzandlar evaziga berilgan bola','Arabcha');
INSERT INTO "all_names" VALUES (57326,'Intizom','O''g''il bolalar ismi','Tartibli, sarishta, odobli','Arabcha');
INSERT INTO "all_names" VALUES (57327,'Intizor','Qiz bolalar ismi','Intiq bo''lib, orziqib kutilgan','Arabcha');
INSERT INTO "all_names" VALUES (57328,'Ipak','Qiz bolalar ismi','Ipakdek muloyim, nafis, nozim,yoqimli qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (57329,'Ipakchi','Qiz bolalar ismi','Ipak matolar to''quvchi hunarmand, chevar qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (57330,'Ipakgul','Qiz bolalar ismi','Nafis,ipak kabi muloyim va guldek ko''rkam qiz','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57331,'Ipaksuluv','Qiz bolalar ismi','Jozibali, maftunkor, ipakdek ko''rkam, zebo qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (57332,'Iporgul','Qiz bolalar ismi','Ipor guli (mushk)dek yoqimli qiz','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57333,'Iqbol','O''g''il bolalar ismi','Baxt, tole, saodat, omad, porloq kelajak.','Arabcha');
INSERT INTO "all_names" VALUES (57334,'Iqboliddin','O''g''il bolalar ismi','Dinning baxtu saodatli, kelajagi porloq farzandi yoki din bergan omadli, baxtli bola din)','Arabcha');
INSERT INTO "all_names" VALUES (57335,'Iqboloy','Qiz bolalar ismi','Toleli, baxtu saodatli, oydek ko''rkam qiz','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57336,'Iqbolxo''ja','O''g''il bolalar ismi','Baxtiyor, saodatmand bola','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57337,'Iqlim','Qiz bolalar ismi','Istarasi issiq, jozibali qiz yoki el, o''lka farzandi.','Arabcha');
INSERT INTO "all_names" VALUES (57338,'Iqroriddin','O''g''il bolalar ismi','Dinga bo''ysungan, musulmonchilikni bo''yniga olgan','Arabcha');
INSERT INTO "all_names" VALUES (57339,'Iris','O''g''il bolalar ismi','Iris- nasibali, farovon, baxtiyor yoki ota-onasining nasibasi, omadi bo''lgan bola','Arabcha');
INSERT INTO "all_names" VALUES (57340,'Irisa','Qiz bolalar ismi','Iris- nasibali, baxtli qiz yoki ota-onasining nasibasi bo''lgan qiz','Arabcha');
INSERT INTO "all_names" VALUES (57341,'Irisali','O''g''il bolalar ismi','Nasibali, rizq-ro''zli, omadli bola','Arabcha');
INSERT INTO "all_names" VALUES (57342,'Irisbeka','Qiz bolalar ismi','Beklar naslidan bo''lgan rizq-ro''zli, nasibasi butun qiz','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57343,'Irisbibi','Qiz bolalar ismi','Rizq-nasibali , qadami qutlug'' qiz','Arabcha, hindcha');
INSERT INTO "all_names" VALUES (57344,'Irisbu','Qiz bolalar ismi','Rizq-ro''zli, nasibali , barakotli qiz','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57345,'Irisdavlat','Qiz bolalar ismi','Badavlat, rizq nasibasi butun va davlatmand qiz','Arabcha');
INSERT INTO "all_names" VALUES (57346,'Irisjon','Qiz bolalar ismi','Davlatmand, nasibasi butun va jondek aziz, shirin qiz','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57347,'Irisli','O''g''il bolalar ismi','Nasibali, baxtli bola.','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57348,'Irismurod','O''g''il bolalar ismi','Orzu qilingan nasibali bola yoki nasibasi butun bola ulg''ayib murodu maqsadiga yetsin','Arabcha');
INSERT INTO "all_names" VALUES (57349,'Iristoy','O''g''il bolalar ismi','Rizqu ro''zli, nasibasi butun, omadli bola','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57350,'Irisxo''ja','O''g''il bolalar ismi','Qut barakali, rizqu nasibasi butun bola','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57351,'Irisxol','Qiz bolalar ismi','Rizqu ro''zli, nasibali va xol bilan tug''ilgan qiz','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57352,'Iroda','Qiz bolalar ismi','Istab, orzu qilib erishilgan qiz yoki allohning irodasi, muruvvati bo''lgan qiz, yohud irodali chidamli qiz','Arabcha');
INSERT INTO "all_names" VALUES (57353,'Irodat','Qiz bolalar ismi','Tilab, orzu tilab olingan qiz yoki irodali, chidamli, sabru toqatli qiz','Arabcha');
INSERT INTO "all_names" VALUES (57354,'Iroq','O''g''il bolalar ismi','Asli yiroq, ya’ni umri uzoq bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (57355,'Irshod','O''g''il bolalar ismi','To''g''ri yo''l ko''rsatuvchi, to''g''ri yo''lga undovchi boshliq, rahbar','Arabcha');
INSERT INTO "all_names" VALUES (57356,'Is’hoq','O''g''il bolalar ismi','Kulgi, xandon, kuluvchi, kulayotgan. is’hoq (iso) payg''ambarning ham ismidir','Qadimiy yahudiycha');
INSERT INTO "all_names" VALUES (57357,'Is’hoqnazar','O''g''il bolalar ismi','Is’hoq (iso) payg''ambarning marhamatli, iltifoti, nazar qilishi tufayli erishilgan o''g''il. is''hoq payg''ambarning nazari, mehri tushgan bola','Qadimiy yahudiycha, arabcha');
INSERT INTO "all_names" VALUES (57358,'Is’hoqqul','O''g''il bolalar ismi','Is’hoq payg''ambarning quli, sodiq xizmatkori','Qadimiy yahudiycha, o''zbekcha');
INSERT INTO "all_names" VALUES (57359,'Is’hoqxo''ja','O''g''il bolalar ismi','Is’hoq payg''ambar ismi berilgan bola','Qadimiy yahudiycha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57360,'Isfahon','O''g''il bolalar ismi','Isfahon (qilich)dek keskir va mahkam. bu eronning mashhur shahzodalaridan birining nomi hamdir','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57361,'Ishiq','O''g''il bolalar ismi','Shu’la, yog''du, ravshanlik, yorug''lik','O''zbekcha');
INSERT INTO "all_names" VALUES (57362,'Ishora','Qiz bolalar ismi','Badanida qanqaydir belgi bilan tug''ilgan qiz yoki allohning xohishi, irodasi','Arabcha');
INSERT INTO "all_names" VALUES (57363,'Ishqiya','Qiz bolalar ismi','Muhabbat, mehru muruvvat sohibasi , qalbi ishqqa to''la','Arabcha');
INSERT INTO "all_names" VALUES (57364,'Iskandar','O''g''il bolalar ismi','Mard, qo''rqmas, dovyurak, jasurlarning sardori yoki himoya qiluvchi, muhofazakor','Yunoncha');
INSERT INTO "all_names" VALUES (57365,'Iskandarsho','O''g''il bolalar ismi','Iskandar shohdek jasur, dovyurak','Yunoncha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57366,'Islimiddin','O''g''il bolalar ismi','Dinning bezagi, ko''rki yoki dinga rivoj beruvchi, yuksaltiruvchi','Arabcha');
INSERT INTO "all_names" VALUES (57367,'Islohot','O''g''il bolalar ismi','O''zgarish, tuzatish (islohot) yillari tug''ilgan bola','Arabcha');
INSERT INTO "all_names" VALUES (57368,'Islom','O''g''il bolalar ismi','O''zini allohning ixtiyoriga topshirish itoatkor, islom diniga bo''ysungan.','Arabcha');
INSERT INTO "all_names" VALUES (57369,'Islomali','O''g''il bolalar ismi','Islomga itoat qiluvchi, musulmon bola','Arabcha');
INSERT INTO "all_names" VALUES (57370,'Islombek','O''g''il bolalar ismi','Musulmonlar diniga bo''ysungan bola','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57371,'Islomberdi','O''g''il bolalar ismi','Alloh ato qilgan musulmon bola yoki alloh musulmon bola ato qildi','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57372,'Islomboqi','O''g''il bolalar ismi','Musulmonlar dini (islom) abadiy, boqiydir yoki muhammad diniga itoat qiluvchi bolaning umri uzoq bo''lsin','Arabcha');
INSERT INTO "all_names" VALUES (57373,'Islomg''ozi','O''g''il bolalar ismi','Islom yo''lida kurashuvchi va g''olib chiquvchi bola','Arabcha');
INSERT INTO "all_names" VALUES (57374,'Islomiddin','O''g''il bolalar ismi','Dinga sodiq bola, xudojo''y, zohid','Arabcha');
INSERT INTO "all_names" VALUES (57375,'Islomiya','Qiz bolalar ismi','Allohga bo''ysunuvchi, sig''inuvchi qiz yoki islom dini muxlisi','Arabcha');
INSERT INTO "all_names" VALUES (57376,'Islommurod','O''g''il bolalar ismi','Islom erishtirgan orzu, murod yoki allohga bo''ysungan bola ulg''ayib murodiga yetsin','Arabcha');
INSERT INTO "all_names" VALUES (57377,'Islomnur','O''g''il bolalar ismi','Musulmonlar dini (islom)ning nuri, yog''dusi yoki islom ato qilgan baxt, omad','Arabcha');
INSERT INTO "all_names" VALUES (57378,'Islomqul','O''g''il bolalar ismi','Islomning sodiq xizmatkori, quli','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57379,'Islomxo''ja','O''g''il bolalar ismi','Musulmon diniga bo''ysunuvchi bola','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57380,'Islomxo''ja','O''g''il bolalar ismi','Islom diniga itoat qiluvchi','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57381,'Isman','O''g''il bolalar ismi','Ismatulla ismining qisqargan shakli.','Arabcha');
INSERT INTO "all_names" VALUES (57382,'Ismat','O''g''il bolalar ismi','Pokiza, ozoda, gunohsiz yoki  taqvodor, poro.','Arabcha');
INSERT INTO "all_names" VALUES (57383,'Ismatulla','O''g''il bolalar ismi','Allohning begunoh, pokiza, yaxshi xislatlar sohibi bo''lmish bandasi. bu nom muhammad (s.a.v.)ning sifati bo''lgan','Arabcha');
INSERT INTO "all_names" VALUES (57384,'Ismatyor','O''g''il bolalar ismi','Soflik, pokizalik yoki yaxshi fazilatlar hamdami','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57385,'Ismigul','Qiz bolalar ismi','Gul ismli qiz, nomi guldek zebo qiz','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57386,'Isminoz','Qiz bolalar ismi','Nazokatli, ishvali, nozik va nafis qiz','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57387,'Ismizar','Qiz bolalar ismi','Tillo (yaxshi) ism sohibi, eng go''zal ismli qiz','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57388,'Ismoil','O''g''il bolalar ismi','Xudo eshitdi yoki allohdan so''rab olingan, alloh tuhfa qilgan bola. tavrotdagi rivoyatga ko''ra, ibrohim payg''ambarning xotini hojar allohdan farzand so''rab ijtijo qilgan. shu tufayli tugilgan bolaga ishmael (ismoil) deb ism berishgan. bu nom muhammad (s.a.v.) oglining ismi ham bolgan.','Qadimiy yahudiycha');
INSERT INTO "all_names" VALUES (57389,'Ismoilqul','O''g''il bolalar ismi','Ismoilning quli, ismoilga bo''ysunuvchi','Qadimiy yahudiycha, o''zbekcha');
INSERT INTO "all_names" VALUES (57390,'Iso','O''g''il bolalar ismi','Allohning tuhfasi, ehsoni, lutfu karami, allohning ko''magi yoki allohning yaqini. iso-qadimiy yahudiycha jexogua, iisus (xristos) nomining arabcha shaklidir','Qadimiy yahudiycha');
INSERT INTO "all_names" VALUES (57391,'Isobat','Qiz bolalar ismi','Halollik,to''g''rilik, rostlik, adolat sohibasi','Arabcha');
INSERT INTO "all_names" VALUES (57392,'Isoberdi','Qiz bolalar ismi','Iso (payg''ambar) bergan, ato qilgan bola','Yahudiycha, o''zbekcha');
INSERT INTO "all_names" VALUES (57393,'Isolat','Qiz bolalar ismi','Mahkam, mustahkam, umri uzoq qiz','Arabcha');
INSERT INTO "all_names" VALUES (57394,'Isom','O''g''il bolalar ismi','Tayanch, suyanch, ya’ni ota-onasiga suyanchiq, ko''makchi bo''luvchi bola','Arabcha');
INSERT INTO "all_names" VALUES (57395,'Isomiddin','O''g''il bolalar ismi','Dinning tutqichi, suyanchi yoki dinga madad beruvchi, ko''makdosh','Arabcha');
INSERT INTO "all_names" VALUES (57396,'Isomurod','O''g''il bolalar ismi','Iso yetkazgan orzu, tilak, isoning muruvvati, tuhfasi','Qadimiy yahudiycha, arabcha');
INSERT INTO "all_names" VALUES (57397,'Isomxo''ja','O''g''il bolalar ismi','Ota-onasining suyanchig''i, madadkori','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57398,'Isonafas','O''g''il bolalar ismi','Iso (payg''ambar)ning nafasi, ko''magi tufayli erishilgan bola yoki iso nafasli,zukko, zehnli bola','Qadimiy yahudiycha, arabcha');
INSERT INTO "all_names" VALUES (57399,'Isoqul','O''g''il bolalar ismi','Iso payg''ambarning quli','Qadimiy yahudiycha, o''zbekcha');
INSERT INTO "all_names" VALUES (57400,'Isoxo''ja','O''g''il bolalar ismi','Iso payg''ambar nomi berilgan va xo''jalar avlodiga mansub bola','Qadimiy yahudiycha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57401,'Isoyor','O''g''il bolalar ismi','Iso (payg''ambar) o''z panohiga oluvchi, qo''llovchi bola','Qadimiy yahudiycha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57402,'Ispan','O''g''il bolalar ismi','Ismand - isfand - isiriq, hazrat ispand. xalq bu o''simlik, uning hidi kishini balo-qazodan, ko''z tegishdan asraydi deb hisoblaydi. shu tufayli u chaqaloqqa ism sifatida qo''yiladi','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57403,'Isrofil','O''g''il bolalar ismi','Xudoning xizmatkori, allohning hukmini ado etuvchi: qadimiy yahudiycha saraf ismining arabcha shakli. rivoyatga ko''ra, u qiyomat kuni nay chalib o''liklarni tiriltirib bir yerga to''playdigan, odamlarni ogohlantiradigan farsihtadir. ba’zi manbalarda yondiruvchi, alangalantiruvchi deb izohlanadi','Qadimiy yahudiycha, arabcha');
INSERT INTO "all_names" VALUES (57404,'Isroil','O''g''il bolalar ismi','Alloh yo''lida kurashuvchi','Qadimiy yahudiycha');
INSERT INTO "all_names" VALUES (57405,'Istad','O''g''il bolalar ismi','Tursun, yashasin, umri uzoq bo''lsin','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (57406,'Istadoy','Qiz bolalar ismi','Tursin, yashasin va oydek suluv qiz bo''lsin','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57407,'Istak','O''g''il bolalar ismi','Xohlab, iltijolar qilib olingan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (57408,'Istakoy','Qiz bolalar ismi','Qo''msab, orzu qilib olingan oydek go''zal qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (57409,'Istam','Qiz bolalar ismi','Aynan: tursin, qolsin, ya’ni umri uzoq bo''lsin, o''lmasin.','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57410,'Istamas','O''g''il bolalar ismi','Chaqaloqni dushmani bo''lmish yovuz kuchlar bolani istamaydi, mensimaydi, ko''zga ilmaydi, demak bola sog''u omon bo''ladi deyilgan ma’noda.','O''zbekcha');
INSERT INTO "all_names" VALUES (57411,'Istamboqi','O''g''il bolalar ismi','Boqiy turuvchi, umri uzoq bo''luvchi bola','Fors-tojikcha, arabcha');
INSERT INTO "all_names" VALUES (57412,'Istara','Qiz bolalar ismi','Istarasi issiq, yoqimtoy, jozibali. sitora yulduzi nomidan.','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57413,'Istat','Qiz bolalar ismi','Tursin, qolsin, ya’ni o''lmasin, umri uzoq bo''lsin. asli: istad, istod','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57414,'Istatpo''lat','O''g''il bolalar ismi','Tursin, yashasin va po''latdek mahkam, mustahkam bo''lsin','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57415,'Istatulla','O''g''il bolalar ismi','Alloh ato qilgan bola tursin, yashasin yoki alloh umrini uzoq qilib bergan bola','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57416,'Iste’dod','O''g''il bolalar ismi','Qobiliyatli, epchil, uddaburon','Arabcha');
INSERT INTO "all_names" VALUES (57417,'Istoda','Qiz bolalar ismi','Turg''un, sabotli, ya’ni yashaydigan bola','Fors-tojikcha');
INSERT INTO "all_names" VALUES (57418,'Itoat','Qiz bolalar ismi','Itoatkor, mo''min-qobil, odobli qiz','Arabcha');
INSERT INTO "all_names" VALUES (57419,'Ittifoq','O''g''il bolalar ismi','Oldingi farzandlarga qo''shilib ketsin va ittifoq bo''lib yashasin','Arabcha');
INSERT INTO "all_names" VALUES (57420,'Ixlos','O''g''il bolalar ismi','Samimiy, sofdil, sadoqatli bola.','Arabcha');
INSERT INTO "all_names" VALUES (57421,'Ixlosa','Qiz bolalar ismi','Sofdil, pokdomon, sadoqatli va xolis qiz','Arabcha');
INSERT INTO "all_names" VALUES (57422,'Ixlosbonu','Qiz bolalar ismi','Sofdil, pokdomon, aslzoda qiz','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (57423,'Ixlosiddin','O''g''il bolalar ismi','Dinga ixlos qo''ygan, dinga sadoqatli bola','Arabcha');
INSERT INTO "all_names" VALUES (57424,'Ixlosiya','Qiz bolalar ismi','Soflik, samimiyat, sadoqat sohibasi','Arabcha');
INSERT INTO "all_names" VALUES (57425,'Ixlosxo''ja','O''g''il bolalar ismi','Sofdil, sadoqatli bola','Arabcha, fors-tojikcha');
