INSERT INTO "all_names" VALUES (60959,'Qaynaroy','Qiz bolalar ismi','Sho''x, jo''shqin, g''ayratli qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (60960,'Qayril','Qiz bolalar ismi','Burilgan, yaxshilik tomonga qayrilsin. bu ism bolaning sog''ayib ketishini yoki navbatdagi bola o''g''il bo''lishini orzu qilishni ifoda qiladi','O''zbekcha');
INSERT INTO "all_names" VALUES (60961,'Qayroq','O''g''il bolalar ismi','Qayroq toshdek mustahkam bo''lsin yoki qayroq - lalmi (bahorkor) ko''kargan paytda tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (60962,'Qays','O''g''il bolalar ismi','Majnunning asl nomi. ma’nosi nomalum. qays - o''lchov, miqdor','Arabcha');
INSERT INTO "all_names" VALUES (60963,'Qaysar','O''g''il bolalar ismi','O`jar,  mahkam, mustahkam yoki hukmdor, podshoh, hokim. bu ismni qadimgi imperator sezar (kesar, kayzer) nomi bilan ham bog''lashadi','Arabcha');
INSERT INTO "all_names" VALUES (60964,'Qaytarboy','O''g''il bolalar ismi','Qaytadi, ya’ni yashaydi yoki oiladagilardan birortasi uzoqqa ketganda tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (60965,'Qaytgan','O''g''il bolalar ismi','Avvalgi turmagan farzandlar o''rniga, evaziga qaytarib berilgan bola','O''zbekcha');
