INSERT INTO "all_names" VALUES (60967,'Qaytmas','O''g''il bolalar ismi','O''jar, chekinmaydigan, bir so''zli , mard, dovyurak','O''zbekcha');
INSERT INTO "all_names" VALUES (60968,'Qayum','O''g''il bolalar ismi','Abadiy majvud bo''luvchi. bu nom allohi taoloning sifatlaridan biri. asli: abduqayyum.','Arabcha');
INSERT INTO "all_names" VALUES (60969,'Qilich','O''g''il bolalar ismi','Qilichdek keskir va mustahkam yoki kindigi qilich bilan kesilgan bola yohud g''olib, muzaffar bola.','O''zbekcha');
INSERT INTO "all_names" VALUES (60970,'Qilichberdi','O''g''il bolalar ismi','Alloh qilichdek keskir, mustahkam o''g''il berdi','O''zbekcha');
INSERT INTO "all_names" VALUES (60971,'Qilichmirza','O''g''il bolalar ismi','Qilichdek o''tkir, mustahkam va mirzalardek o''qimishli, kelishgan yigit bo''lsin','O''zbekcha, fors-tojikcha');
