INSERT INTO "all_names" VALUES (61027,'Qodirnazar','O''g''il bolalar ismi','Qodir, ya’ni allohnig iltifoti, e''tibori (nazari) tufayli erishilgan bola','Arabcha');
INSERT INTO "all_names" VALUES (61028,'Qodirniso','Qiz bolalar ismi','Ayollarning kuchlisi, qudratlisi, qobiliyatlisi yoki allohning xizmatkori, bandasi bo''lgan qiz','Arabcha');
