INSERT INTO "all_names" VALUES (61051,'Qora','O''g''il bolalar ismi','Kuchli, qudratli bola yoki qoracha bo''lib tug''ilgan bola yohud qoracha urug''iga (qirq qabilasi tarmog''i) mansub bola.','O''zbekcha');
