INSERT INTO "all_names" VALUES (61083,'Qo''rg''onboy','O''g''il bolalar ismi','Qo''rg''ondek mahkam, mustahkam bo''lsin yoki himoyalangan, muhofazalangan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61084,'Qori','O''g''il bolalar ismi','Sog'' ulg''ayib qur’onni yoddan qiroat qiluvchi (qori) bo''lsin yoki marhum qori bobosining ismi bilan nomlangan bola','Arabcha');
INSERT INTO "all_names" VALUES (61085,'Qo''riqboy','O''g''il bolalar ismi','Qo''riqlangan, himoyalangan bola yoki bo''z bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61086,'Qoriqul','O''g''il bolalar ismi','Allohning xudojo''y, toat-ibodat qiluvchi bandasi (quli)','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (61087,'Qoriya','Qiz bolalar ismi','Ulg''ayib qur’onning mohir qiroatchisi, xudojo''y ayol bo''lsin.','Arabcha');
INSERT INTO "all_names" VALUES (61088,'Qorjigit','O''g''il bolalar ismi','Birinchi qor yog''ayotganda tug''ilgan o''g''il ulg''ayib katta yigit bo''lsin yoki birinchi qorni boshlab kelgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61089,'Qorjon','O''g''il bolalar ismi','Birinchi qor yog''ayotganda tug''ilgan suyukli bola','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61090,'Qorkeldi','O''g''il bolalar ismi','Birinchi qorni olib kelgan, birinchi qor yog''ayotganda tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61091,'Qorli','O''g''il bolalar ismi','Birinchi qor yog''ganda tug''ilgan, qorni olib kelgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61092,'Qormurod','O''g''il bolalar ismi','Birinchi qor yog''ganda tug''ilgan o''g''il ulg''ayib murodu maqsadiga yetsin yoki birinchi qor yog''ganda erishilgan orzuimiz','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61093,'Qo''rqmas','O''g''il bolalar ismi','Mard, jasur, dovyurak','O''zbekcha');
INSERT INTO "all_names" VALUES (61094,'Qorun','O''g''il bolalar ismi','Boylik, davlat yoki  xorun (qorundek) boy-badavlat bo''lsin','Arabcha');
INSERT INTO "all_names" VALUES (61095,'Qorxol','Qiz bolalar ismi','Birinchi qor yog''ganda tug''ilgan xolli qiz.','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61096,'Qorxon','Qiz bolalar ismi','Birinchi qor yog''ganda tug''ilgan baland martabali, e’zozli qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (61097,'Qoryog''di','O''g''il bolalar ismi','Birinchi qor yog''ganda tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61098,'Qo''sha','O''g''il bolalar ismi','Badanida qo''shaloq belgilar bilan tug''ilgan bola yoki qo''shali tipli ismlarning qisqargan shakli','O''zbekcha');
INSERT INTO "all_names" VALUES (61099,'Qo''shan','O''g''il bolalar ismi','Qo''shnazar, qo''shniyoz (xushnazar, xushniyoz) kabi ismlarning qisqargan shakli','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61100,'Qo''sharboy','O''g''il bolalar ismi','Alloh ota-onasiga yoki oldingi bolalarga qo''shar, sog''u omon ulg''ayar deb umid qilingan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61101,'Qo''shbosh','O''g''il bolalar ismi','Boshi qo''sh bo''lsin, o''lmasin, yashab ketsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61102,'Qo''shbo''ta','O''g''il bolalar ismi','Bo''tadek suyukli (bo''taloq) o''g''il ulg''ayib kattalar safiga qo''shilsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61103,'Qo''shchi','O''g''il bolalar ismi','Dalaga qo''sh chiqqanda tug''ilgan bola yoki sog'' ulg''ayib boshqa tengdoshlari safiga qo''shilsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61104,'Qo''shdavlat','O''g''il bolalar ismi','Qo''sh boylik, qo''shaloq baxt bo''lgan bola yoki qar. xushdavlat','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61105,'Qo''shinboy','O''g''il bolalar ismi','Otasi yoki akasi armiyada bo''lganda tug''ilgan bola yoki kuchli, qudratli, jasur','O''zbekcha');
INSERT INTO "all_names" VALUES (61106,'Qo''shjon','O''g''il bolalar ismi','Qo''sh so''zi bilan boshlangan ba’zi qo''shma ismlarning qisqargan shakli yoki oldingi bolalar safiga qo''shilsin','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (61107,'Qo''shmoq','O''g''il bolalar ismi','Ota-onasi turli millatdan bo''lgan oila farzandi, metis bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61108,'Qo''shoq','O''g''il bolalar ismi','Badanida qandaydir ortiqcha, belgi bilan (qo''l yoki oyog''ida qo''shimcha barmoqcha yoki boshqa xil xususiyatlar) tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61109,'Qo''shpo''lat','O''g''il bolalar ismi','Po''latdek mustahkam bo''lsin va sog'' ulg''ayib o''zgalar safiga qo''shilsin yoki qar. xushpolat','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (61110,'Qo''shqin','O''g''il bolalar ismi','Sog'' ulg''ayib o''zgalar safiga qo''shilsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61111,'Qo''shsha','O''g''il bolalar ismi','Ikki barmog''i qo''shilib, bir-biriga yopishib turgan holda tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61112,'Qo''shtan','O''g''il bolalar ismi','Badanida biror bir ortiqcha, g''ayritabiiy belgi bilan tug''ilgan bola','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (61113,'Qo''shtirak','O''g''il bolalar ismi','Bola sog'' ulg''ayib ota-onasiga suyanch, ko''makchi bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61114,'Qo''shtoy','O''g''il bolalar ismi','Erkatoy, suyukli o''g''il ulg''ayib o''zgalar safiga qoshilsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61115,'Qo''shyurak','O''g''il bolalar ismi','Qo''sh yurakli, jasur, botir, dovyurak','O''zbekcha');
INSERT INTO "all_names" VALUES (61116,'Qosidulla','O''g''il bolalar ismi','Allohning xabarlarini yetkazuvchi, allohning elchisi','Arabcha');
INSERT INTO "all_names" VALUES (61117,'Qosim','O''g''il bolalar ismi','Taqsimlovchi, inson qismatini belgilovchi. muhammad (s.a.v.) o''g''lining ismi.','Arabcha');
INSERT INTO "all_names" VALUES (61118,'Qosimberdi','O''g''il bolalar ismi','Rizq-ro''zni tarqatuvchi, inson qismatini belgilovchi, ya’ni alloh bergan bola','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (61119,'Qosimqul','O''g''il bolalar ismi','Qosim, ya’ni allohning bandasi, quli','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (61120,'Qosimtoy','O''g''il bolalar ismi','Qosim, ya’ni alloh bergan suyukli, erka bola','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (61121,'Qosimyor','O''g''il bolalar ismi','Rizq-ro''z, nasiba taqsimlovchi, ya’ni alloh qo''llab yursin','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61122,'Qovunboy','O''g''il bolalar ismi','Qovun pishig''ida yoki qovun, ya’ni poliz tepasiga ko''chib chiqqanda tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61123,'Qovus','O''g''il bolalar ismi','Qavs oyi (shamsiya yil hisobining 9 oyi 22 noyabr - 21 dekabrga to''g''ri keladi) da tug''ilgan bola','Arabcha');
INSERT INTO "all_names" VALUES (61124,'Qo''yboqar','O''g''il bolalar ismi','Ulg''ayib qo''zilarni boqsin, ya’ni qo''ylari, mol-dunyosi ko''p, badavlat bolsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61125,'Qo''ychi','O''g''il bolalar ismi','Oldida qo''ylari, mollari ko''p, boy-badavlat bo''lsin.','O''zbekcha');
INSERT INTO "all_names" VALUES (61126,'Qo''yli','O''g''il bolalar ismi','Sog'' ulg''ayib qo''ylari ko''p, badavlat bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61127,'Qo''yliqul','O''g''il bolalar ismi','Allohning boy-badavlat , rizq nasibali bandasi (quli)','O''zbekcha');
INSERT INTO "all_names" VALUES (61128,'Qo''ymurod','O''g''il bolalar ismi','Murodu maqsadimiz, orzuimiz bo''lgan bola ulg''ayib murodiga yetsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61129,'Qo''ysin','O''g''il bolalar ismi','Tinch, osoyishta bo''lsin, yashasin, umri uzoq bo''lsin.','O''zbekcha');
INSERT INTO "all_names" VALUES (61130,'Qo''ysintosh','O''g''il bolalar ismi','Sog'', osoyishta va toshdek mustahkam bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61131,'Qo''ysuluv','Qiz bolalar ismi','Go''zal, zebo qiz, tinch, osoyishta bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61132,'Qozi','O''g''il bolalar ismi','Ulg''ayib adolatpesha, diniy hakam bo''lsin yoki qozi bo''lib o''tgan bobosining ismi berilgan bola.','Arabcha');
INSERT INTO "all_names" VALUES (61133,'Qo''zi','O''g''il bolalar ismi','Suyukli, erkatoy bola yoki molli-davlatli bo''lsin yohud qo''ylar qo''zilagan mavsumda tug''ilgan bola.','O''zbekcha');
INSERT INTO "all_names" VALUES (61134,'Qo''zibola','O''g''il bolalar ismi','Erkatoy, arzanda, suyukli bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61135,'Qo''ziboqar','O''g''il bolalar ismi','Sog'' ulg''ayib qo''zilarni boquvchi yoki boy-badavlat bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61136,'Qo''zigul','Qiz bolalar ismi','Qo''zigul (erta bahorda ochiladigan sariq gulli o''simlik) ochilgan paytida tug''ilgan qiz yoki qo''ziguldek nozik, chiroyli qiz','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61137,'Qo''zim','O''g''il bolalar ismi','Erkatoyim, suyuklim yoki qo''zi so''zi bilan boshlangan ba’zi qo''shma ismlarning qisqargan shakli','O''zbekcha');
INSERT INTO "all_names" VALUES (61138,'Qo''zioy','Qiz bolalar ismi','Suyukli, erka va oydek suluv qiz yoki qo''ylar qo''zilaydigan mavsumda tug''ilgan oydek go''zal qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (61139,'Qoziqul','O''g''il bolalar ismi','O''zini diniy adolat yo''liga bag''ishlagan bola','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (61140,'Qo''ziturdi','O''g''il bolalar ismi','Erka, suyukli o''g''il tursin, yashasin','O''zbekcha');
INSERT INTO "all_names" VALUES (61141,'Qo''zivon','O''g''il bolalar ismi','Qo''zilarni boquvchi, qo''ychibon yoki sog'' ulg''ayib qo`ylari kop, badavlat bo`lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61142,'Qo''zixol','Qiz bolalar ismi','Xol bilan tug''ilgan erka, suyukli qiz','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61143,'Qo''ziyor','O''g''il bolalar ismi','Suyukli, erka o''g''ilga alloh o''zi yor bo''lsin yoki boylik, davlat sohibi','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61144,'Qozoq','O''g''il bolalar ismi','Ko''rinishi qozoqqa o''xshagani uchun shunday atalgan yoki erkin, hur, ozod yohud uyga qozoq mehmon kelganda yoki qozoqlar orasida tug''ilgan bola ham shunday nomlanadi.','O''zbekcha, qadimiy turkiycha');
INSERT INTO "all_names" VALUES (61145,'Qubod','Qiz bolalar ismi','Hukmron, podshoh , sardor','Fors-tojikcha');
INSERT INTO "all_names" VALUES (61146,'Quddusiya','Qiz bolalar ismi','Pokiza, gunohsiz, farishta qiz','Arabcha');
INSERT INTO "all_names" VALUES (61147,'Qudrat','O''g''il bolalar ismi','Asli qudratulla ya''ni allohning qudrati.  quvvatli, kuchli, qodir.','Arabcha');
INSERT INTO "all_names" VALUES (61148,'Qudratali','O''g''il bolalar ismi','Alining qudrati, iltifoti tufayli tug''ilgan bola,  alining tuhfasi','Arabcha');
INSERT INTO "all_names" VALUES (61149,'Qudratoy','Qiz bolalar ismi','Kuchli, layoqatli qiz yoki badanida qandaydir ortiqcha, g''ayritabiiy belgi bilan tug''ilgan bola','Arabcha, o''zbekcha');
INSERT INTO "all_names" VALUES (61150,'Qudratulla','O''g''il bolalar ismi','Allohning qudrati, irodasi bilan tug''ilgan bola yoki badanida qandaydir g''ayritabiiy belgi, nuqson bilan tug''ilgan bola','Arabcha');
INSERT INTO "all_names" VALUES (61152,'Qulahmad','O''g''il bolalar ismi','Ahmadning (muhammad payg''ambar) xizmatkori, ahmadga sodiq kishi','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61153,'Qulali','O''g''il bolalar ismi','Alining xizmatkori, aliga sodiq. sol: aliqul','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61154,'Qulay','O''g''il bolalar ismi','Qul so''zi bilan boshlangan ba’zi qo''shma ismlarning (qulahmad, qulmurod) shakli yoki muloyim, yoqimli, odobli','O''zbekcha');
INSERT INTO "all_names" VALUES (61155,'Qulbashar','O''g''il bolalar ismi','Xalq, insoniyat xizmatkori','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61156,'Qulbek','O''g''il bolalar ismi','Qullarning boshlig''i, sardori yoki allohning beklar avlodidan bo''lgan xizmatkori (quli)','O''zbekcha');
INSERT INTO "all_names" VALUES (61157,'Qulberdi','O''g''il bolalar ismi','Alloh bergan xizmatkori, yordamchi yoki berganning, yaratganning quli.','O''zbekcha');
INSERT INTO "all_names" VALUES (61158,'Qulbobo','O''g''il bolalar ismi','Marhum bobosining ismi berilgan bola.','O''zbekcha');
INSERT INTO "all_names" VALUES (61159,'Qulboq','O''g''il bolalar ismi','Allohning baxtli bandasi','O''zbekcha');
INSERT INTO "all_names" VALUES (61160,'Qulboq','O''g''il bolalar ismi','Allohning baxi kulgan quli','O''zbekcha');
INSERT INTO "all_names" VALUES (61161,'Qulbosh','O''g''il bolalar ismi','Qullarning boshlig''i, sardori','O''zbekcha');
INSERT INTO "all_names" VALUES (61162,'Qulbotir','O''g''il bolalar ismi','Allohning jasur, dovyurak bandasi. sol: botirqul','O''zbekcha');
INSERT INTO "all_names" VALUES (61163,'Qulboy','O''g''il bolalar ismi','Allohning boy-badavlat bandasi. sol: boyqul','O''zbekcha');
INSERT INTO "all_names" VALUES (61164,'Qulbozor','O''g''il bolalar ismi','Allohning bozor kuni tug''ilgan bandasi.','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61165,'Qulcha','O''g''il bolalar ismi','Jajji, kichik, kenja qul','O''zbekcha');
INSERT INTO "all_names" VALUES (61166,'Quldavlat','O''g''il bolalar ismi','Allohning boy-badavlat bandasi.','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61167,'Quldor','O''g''il bolalar ismi','Qullar egasi, boy-badavlat hukmdor','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61168,'Qulfiddin','O''g''il bolalar ismi','Dinning mustahkamligi, dinning irodali, sobitqadam farzandi yoki dinning gullab-yashnashi, dinning rivoji, go''zalligi','Arabcha');
INSERT INTO "all_names" VALUES (61169,'Qulfiniso','Qiz bolalar ismi','Ayollarning eng mahkami, mustahkami yoki ayollarning go''zali, zebosi','Arabcha');
INSERT INTO "all_names" VALUES (61170,'Qulfiya','Qiz bolalar ismi','Mustahkam, mahkam qiz yoki quvnab-yashnab, yayrab o''ssin','Arabcha');
INSERT INTO "all_names" VALUES (61171,'Qulgina','Qiz bolalar ismi','Kenjatoy qul, asira, cho''ri yoki mo''gulcha xolg''ona - sichqon, ya’ni sichqon yili tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61172,'Quli','O''g''il bolalar ismi','Oxirida qul, quli so''zlari bilan kelgan qo''shma ismlarning (ollohqul, olloquli kabi) qisqargan shakli','O''zbekcha');
INSERT INTO "all_names" VALUES (61173,'Quljamila','Qiz bolalar ismi','Allohning go''zal, zebo bandasi yoki go''zal cho''ri, xizmatkor','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61174,'Quljon','O''g''il bolalar ismi','Suyukli, erka qul, ya’ni o''g''il','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61175,'Quljuma','O''g''il bolalar ismi','Allohning juma kuni tug''ilgan bandasi, sodiq xizmatchisi.','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61176,'Qulli','O''g''il bolalar ismi','Qul so''zi bilan boshlangan ba’zi qo''shma ismlar (qulmurod, qulmuhammad)ning  qisqargan shakli','O''zbekcha');
INSERT INTO "all_names" VALUES (61177,'Qulluq','O''g''il bolalar ismi','O''g''il bergani uchun allohga qulluq qilamiz','O''zbekcha');
INSERT INTO "all_names" VALUES (61178,'Qulman','O''g''il bolalar ismi','Qul so''zi bilan boshlangan ba’zi qo''shma ismlar (qulmuhammad, qulniyoz, qulnazar)ning qisqargan shakli','O''zbekcha');
INSERT INTO "all_names" VALUES (61179,'Qulmiddin','O''g''il bolalar ismi','Dinning sodiq xizmatkori, haqqoniy dinchi, xudojo''y','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61180,'Qulmo''min','O''g''il bolalar ismi','Allohning yovvosh, mo''min-qobil bandasi (quli).','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61181,'Qulmuhammad','O''g''il bolalar ismi','Muhammad (s.a.v.) ning sodiq xizmatkori (quli) bo''lsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61182,'Qulmurod','O''g''il bolalar ismi','Allohning sodiq bandasi ulg''ayib murod-maqsadiga yetsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61183,'Qulnazar','O''g''il bolalar ismi','Allohning e’tibori (nazari) tushgan bola, allohning iltifoti, muruvvati tufayli tug''ilgan bola.','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61184,'Qulniyoz','O''g''il bolalar ismi','Allohdan yolvorib, so''rab olingan bola yoki allohning tuhfasi, sovg''asi.','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61185,'Qulomon','O''g''il bolalar ismi','Allohning sodiq bandasi bo''lgan bola sog''-omon ulg''aysin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61186,'Qulontoy','O''g''il bolalar ismi','Qulondek ziyrak, sog''lom bo''lsin yoki qulon (qulonchi) urug''iga mansub bola','O''zbekcha');
INSERT INTO "all_names" VALUES (61187,'Qulpinoy','Qiz bolalar ismi','Yayrovchi, yashnovchi (qulf uruvchi) qiz yoki qulupnay pishganda tug''ilgan qiz yohud qulflangan, mahkamlangan, himoyalangan qiz, berk','O''zbekcha, ruscha');
INSERT INTO "all_names" VALUES (61188,'Qulpiya','Qiz bolalar ismi','Hayoti qulf urib yashnasin, tolei baland, baxtli bo''lsin','Arabcha');
INSERT INTO "all_names" VALUES (61189,'Qulsum','Qiz bolalar ismi','Lo''ppi yuzli, kulcha yuzli qiz','Arabcha');
INSERT INTO "all_names" VALUES (61190,'Qultosh','O''g''il bolalar ismi','Allohning toshdek mustahkam bandasi (quli)','O''zbekcha');
INSERT INTO "all_names" VALUES (61191,'Qulunboy','O''g''il bolalar ismi','Qulun (1 yillik toy, emuvchi toychoq)dek go''zal bola yoki qulundek o''ynoqlab, yayrab o''ssin','O''zbekcha');
INSERT INTO "all_names" VALUES (61192,'Quluntoy','O''g''il bolalar ismi','Toychoqdek yayrab, shodlanib o''ssin','O''zbekcha');
INSERT INTO "all_names" VALUES (61193,'Qulxo''ja','O''g''il bolalar ismi','Allohning xo''jalar naslidan bo''lgan bandasi (quli)','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61194,'Qulzoda','Qiz bolalar ismi','Qullar nasliga mansub qiz','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (61195,'Qumri','Qiz bolalar ismi','Qumri (quyosh)dek yuvosh, beozor qiz.','Arabcha');
INSERT INTO "all_names" VALUES (61196,'Qumriddin','O''g''il bolalar ismi','Dinning beozor, yovvosh bolasi','Arabcha');
INSERT INTO "all_names" VALUES (61197,'Qumriniso','Qiz bolalar ismi','Beozor, yuvvosh, odobli, muloyim ayol','Arabcha');
INSERT INTO "all_names" VALUES (61198,'Qumriqiz','Qiz bolalar ismi','Qumridek yovvosh, beozor, muloyim qiz','Arabcha');
INSERT INTO "all_names" VALUES (61199,'Qunduz','Qiz bolalar ismi','Qunduzdek, go''zal, zebo qiz.','O''zbekcha');
INSERT INTO "all_names" VALUES (61200,'Qunduzali','O''g''il bolalar ismi','Qunduzdek, chiroyli, go''zal yigit yuksaklikka erishsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (61201,'Qunduzbeka','Qiz bolalar ismi','Qunduzdek go''zal va baland martabali, aslzoda qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (61202,'Qunduzboy','O''g''il bolalar ismi','Qunduzdek chiroyli yigit','O''zbekcha');
INSERT INTO "all_names" VALUES (61203,'Qunon','O''g''il bolalar ismi','Qunondek (uch yashar erkak ot) sho''xchan va qudratli yigit bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (61204,'Quralay','Qiz bolalar ismi','Kiyik yoki bug''i bolachasining qora ko''zlari, go''zal, zebo qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (61205,'Qurbat','O''g''il bolalar ismi','Yaqinlashishi, yetishish, orzuga erishish yoki qarindoshlik, samimiyat ya`ni  allohga yaqinlashish','Arabcha');
