INSERT INTO "all_names" VALUES (62597,'Sohibqiron','O''g''il bolalar ismi','Sohibqiron so''zining aynan ma’nosi «ikki baxt, tole sayyorasi: nohid (venera) va mushtariy (yupiter) yoxud nohid va quyosh birlashuvi egasi (sohibi)» bo''lib, sharq xalqlarida, xususan movarounnahr, xurosonda o''rta asrlarda quyosh sistemasiga kiruvchi yuqoridagi sayyoralar bir-biri bilan yaqinlashgan vaqtda tug''ilgan bolaga shunday laqab berilgan. «sohibqiron»ning arabchadagi lug''aviy ma’nosi – baxtli, muzaffar bo''lib, «qiron» – ilmi nujum (astronomiya) da ikki sayyora (yulduz) ning bir joyda uchrashishi, yaqinlashishiga aytilgan. munajjimlarning fikricha, bu paytda tug''ilgan bola kelajakda baxtli, ulug'' martabali bo''lishi muqarrar sanalgan.','Arabcha, fors-tojikcha');
