INSERT INTO "all_names" VALUES (64247,'Yodgor','O''g''il bolalar ismi','Tug''ilgandan keyin ota (yoki onasi) vafot etgan, ulardan esdalik, yodgor bo''lib qolgan farzand','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64248,'Yodgora','Qiz bolalar ismi','Tug''ilgandan keyin ota (yoki onasi) vafot etgan, ulardan yodgor bo''lib qolgan qiz','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64249,'Yodgorali','O''g''il bolalar ismi','Ota-onasidan yodgor bo''lib qolgan bola ulug'' martabalarga erishsin','Fors-tojikcha, arabcha');
INSERT INTO "all_names" VALUES (64250,'Yodgorbibi','Qiz bolalar ismi','Onasi yoki otasidan yodgor bo''lib qolgan qiz, ulg''ayib, baland martabalar sohibi bo''lsin','Fors-tojikcha, o''zbekcha, hindcha');
INSERT INTO "all_names" VALUES (64251,'Yodgorgul','Qiz bolalar ismi','Onasi yoki otasidan yodgor bo''lib qolgan, go''zal, zebo qiz','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64252,'Yodgoroy','Qiz bolalar ismi','Onasi yoki otasidan yodgor bo''lib qolgan oydek suluv qiz','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64253,'Yodgorqiz','Qiz bolalar ismi','Vafot etgan onasi yoki otasidan yodgor bo''lgan qiz','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64254,'Yodgorqul','O''g''il bolalar ismi','Vafot etgan otasi yoki onasidan yodgor bo''lib qolgan allohning bandasi','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64255,'Yodgorxo''ja','O''g''il bolalar ismi','Vafot etgan otasidan yodgor bo''lgan qolgan va xo''jalar avlodiga mansub bola','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64256,'Yodgorxon','Qiz bolalar ismi','Onasi yoki otasidan yodgor bo''lib qolgan qadrli, e’zozli qiz','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64257,'Yodulla','O''g''il bolalar ismi','Allohning kuchi, qudrati yoki allohning yod etuvchi','Fors-tojikcha, arabcha');
INSERT INTO "all_names" VALUES (64258,'Yog''di','O''g''il bolalar ismi','Umri yog''du (shu’la, nur)ga to''la bo''lsin, ya''ni baxtli tolei baland bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (64259,'Yog''i','O''g''il bolalar ismi','Harakatchan, tinmas yoki jasur, shijoatli','O''zbekcha');
INSERT INTO "all_names" VALUES (64260,'Yog''inboy','O''g''il bolalar ismi','Yog''in-chochin serob paytda tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (64261,'Yo''lbars','O''g''il bolalar ismi','Yo''lbars (arslon)dek kuchli, qudratli','O''zbekcha');
INSERT INTO "all_names" VALUES (64262,'Yo''lbek','O''g''il bolalar ismi','Yo''li ochiq bo''lib, alloh kelajagini bersin yoki yo''lda tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (64263,'Yo''lberdi','O''g''il bolalar ismi','Yo''lda (safar)da tug''ilgan bola','O''zbekcha');
INSERT INTO "all_names" VALUES (64264,'Yo''lbo''ldi','O''g''il bolalar ismi','Otasiga (oldingi akalariga) hamroh, yo''ldosh bo''lib yursin','O''zbekcha');
INSERT INTO "all_names" VALUES (64265,'Yo''lbosar','O''g''il bolalar ismi','Ulg''ayib yurib ketsin yoki oldingi bolalar izni bosib yursin','O''zbekcha');
INSERT INTO "all_names" VALUES (64266,'Yo''lbuvi','Qiz bolalar ismi','Yo''l (safar)da tug''ilgan qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (64267,'Yo''lchi','O''g''il bolalar ismi','Hamroh, do''st, esh yoki yo''l ko''rsatuvchi, to''gri yo`lga boshlovchi yoki  boshliq, sarkor.','O''zbekcha');
INSERT INTO "all_names" VALUES (64268,'Yolchin','O''g''il bolalar ismi','Sayr, sayohat chog''ida, yo''lda tug''ilgan bola yoki yolli, yoldor, ya’ni dovyurak bola','O''zbekcha');
INSERT INTO "all_names" VALUES (64269,'Yo''ldon','O''g''il bolalar ismi','Yo''ldosh so''zi bilan boshlangan ismlarning bir ko''rinishi. yaqinlariga hamroh bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (64270,'Yoldorboy','O''g''il bolalar ismi','Yo''l-yo''lli, yo''li ochiq, yo''li ravon yoki tolei baland, istiqbolli bola','O''zbekcha');
INSERT INTO "all_names" VALUES (64271,'Yo''ldosh','O''g''il bolalar ismi','Otasi yoki akalariga esh, hamroh bo''lib yursin.','O''zbekcha');
INSERT INTO "all_names" VALUES (64272,'Yo''ldoshali','O''g''il bolalar ismi','Ota-onasiga hamroh, esh bo''lib yursin va buyuk inson bo''lsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (64273,'Yo''ldoshbu','Qiz bolalar ismi','Otasiga (oldingi aka-opalariga)do''st, hamroh bo''lib yursin','O''zbekcha');
INSERT INTO "all_names" VALUES (64274,'Yo''ldoshmat','O''g''il bolalar ismi','Muhammadning yo''ldoshi hamrohi bo''lsin','O''zbekcha, arabcha');
