INSERT INTO "all_names" VALUES (64276,'Yo''ldoshmurod','O''g''il bolalar ismi','Ota-onasi (aka-ukalariga) hamroh bo''lsin va ulg''ayib murod-maqsadiga yetsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (64277,'Yo''ldoshoy','Qiz bolalar ismi','Ota-onasiga hamroh, esh bo''lib yuruvchi va oydek ko''rkam qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (64278,'Yo''ldoshxo''ja','O''g''il bolalar ismi','Ota-onasining hamroh, suyanchi bo''lgan xo''ja avlodiga mansub bola','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (64279,'Yo''ldoshxon','Qiz bolalar ismi','Ota-onasiga hamroh, esh bo''lib yuruvchi, qadrli, baland martabali qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (64280,'Yolg''och','O''g''il bolalar ismi','Otasiga (oldingi bolalarga) ulansin, yolg''ashsin','O''zbekcha');
INSERT INTO "all_names" VALUES (64281,'Yo''lim','O''g''il bolalar ismi','Yo''l so''zi bilan boshlangan qo''shma ismlarning bir  ko''rinishi. alloh yo''lini bersin, maqsadiga yetsin','O''zbekcha');
