INSERT INTO "all_names" VALUES (64283,'Yo''lli','O''g''il bolalar ismi','Yo''l so''zi bilan boshlangan qo''shma ismlarning qisqa shakli yoki xudo yo''lini bersin, ya’ni umri uzoq bo''lsin','O''zbekcha');
INSERT INTO "all_names" VALUES (64284,'Yo''llibeka','Qiz bolalar ismi','Yo''lda (safarda) tug''ilgan qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (64285,'Yo''lmuhammad','O''g''il bolalar ismi','Yo''lda (safarda) tug''ilgan bolaga muhammad (s.a.v.) yor bo''lsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (64286,'Yo''lomon','O''g''il bolalar ismi','Xudo yo''lini berib eson-omon ulg''aysin yoki yo''lda tug''ilgan bolaning umri uzoq bolsin','O''zbekcha');
INSERT INTO "all_names" VALUES (64287,'Yolqin','O''g''il bolalar ismi','O''t yolqini kabi nurli, ravshan, otashin','O''zbekcha');
INSERT INTO "all_names" VALUES (64288,'Yolqina','Qiz bolalar ismi','Nurli, yolqinli, otashin qiz','O''zbekcha');
INSERT INTO "all_names" VALUES (64289,'Yolqinxo''ja','O''g''il bolalar ismi','Xo''jalar naslidan bo''lgan nurli, yolqinli bola','O''zbekcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (64290,'Yo''lqutli','O''g''il bolalar ismi','Yo''li (umri) qutlug'', baxtli bola','O''zbekcha');
INSERT INTO "all_names" VALUES (64291,'Yo''ltoy','O''g''il bolalar ismi','Yo''li bor, umri uzoq bola yoki baxtli hamda suyukli bola','O''zbekcha');
INSERT INTO "all_names" VALUES (64292,'Yo''lturdi','O''g''il bolalar ismi','Yo''lda tug''ilgan o''g''il tursin, umri uzoq ko''rsin','O''zbekcha');
