INSERT INTO "all_names" VALUES (64297,'Yondoshali','O''g''il bolalar ismi','Ota-onasi o''zidan oldingi aka-opalariga hamroh bo''lib o''ssin va madadkor bo''lsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (64298,'Yontoq','O''g''il bolalar ismi','Yontoqdek achchiq va ignali bola. chaqaloq dushmani - jin, ajinalarni chalg''itish uchun beriluvchi ism','O''zbekcha');
INSERT INTO "all_names" VALUES (64299,'Yoqub','O''g''il bolalar ismi','Izidan boruvchi yoki  sabotli, matonatli, tirishqoq, qaytmas, jasur. bu ism orqali ko''pincha yoqub (jacob) alayhissalomga nisbat beriladi','Qadimiy yahudiycha');
INSERT INTO "all_names" VALUES (64300,'Yoqubberdi','O''g''il bolalar ismi','Yoqub (as)ning muruvvati, iltifoti bo''lgan bola','Qadimiy yahudiycha, o''zbekcha');
INSERT INTO "all_names" VALUES (64301,'Yoqubkeldi','O''g''il bolalar ismi','Yoqub (as)ning iltifot qilgan bola tug''ildi (keldi)','Qadimiy yahudiycha, o''zbekcha');
INSERT INTO "all_names" VALUES (64302,'Yoqut','Qiz bolalar ismi','Qizil rangli qimmatbaho tosh, yoqut. turkiy xalqlar yoqut kishini turli kasalliklardan asraydi, davo bo''ladi deb hisoblashgan','Arabcha, qadimiy yahudiycha');
