INSERT INTO "all_names" VALUES (64304,'Yoqutoy','Qiz bolalar ismi','Yoqutdek suluv, bebaho, nodir va oydek qiz','Arabcha');
INSERT INTO "all_names" VALUES (64305,'Yoqutxon','Qiz bolalar ismi','Yoqutdek nodir va baland martabali, e’zozli qiz','Arabcha');
INSERT INTO "all_names" VALUES (64306,'Yor','O''g''il bolalar ismi','Do''st, hamroh, yo''ldosh yoki tarkibida yor so''zi mavjud ismlarning (yormuhammad, muhammadyor kabi) bir shakli','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64307,'Yora','Qiz bolalar ismi','Bilaguzuk, ya’ni bilaguzukdek mahkam va e''tiborli qiz','Fors-tojikcha');
