INSERT INTO "all_names" VALUES (64310,'Yorbek','O''g''il bolalar ismi','Beklar nasliga mansub bola. oiladagilarga hamroh, yo''ldosh bo''lib o''ssin','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64311,'Yorbo''ldi','O''g''il bolalar ismi','Avvalgi farzandlarga (otasiga) hamrohi, yo''ldosh bo''lib o''ssin','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64312,'Yorboy','O''g''il bolalar ismi','Ulfat, do''st, hamdam, esh . yaqinlariga hamdam,  madadkor bo''lib yursin','Fors-tojikcha, o''zbekcha');
