INSERT INTO "all_names" VALUES (64317,'Yorkeldi','O''g''il bolalar ismi','Oilaga yordamchi, suyanch keldi','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64318,'Yorlaq','O''g''il bolalar ismi','Yorlaqab, yorliqolgan ismlarning boshqa shakli','O''zbekcha');
