INSERT INTO "all_names" VALUES (64343,'Yostiqali','O''g''il bolalar ismi','Ota-onasiga suyanch, tayanch bo''lsin','O''zbekcha, arabcha');
INSERT INTO "all_names" VALUES (64344,'Yosuman','Qiz bolalar ismi','Yosuman guldek chiroyli, zebo qiz','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64345,'Yovbosar','O''g''il bolalar ismi','Yovlarni yenguvchi, ya’ni kasalliklarni yenguvchi bola','O''zbekcha');
