INSERT INTO "all_names" VALUES (64647,'Zoid','O''g''il bolalar ismi','Ustuvor, buyuk, yuksak turuvchi yoki umri ziyoda, uzun bo''lsin.','Arabcha');
INSERT INTO "all_names" VALUES (64648,'Zoim','O''g''il bolalar ismi','Boshliq, rahbar, yo''lboshchi yoki oiladagi birinchi, bosh bola','Arabcha');
INSERT INTO "all_names" VALUES (64649,'Zoima','Qiz bolalar ismi','Boshliq, sarkor yoki oiladagi birinchi, bosh bola','Arabcha');
INSERT INTO "all_names" VALUES (64650,'Zoira','Qiz bolalar ismi','Ziyoratdan keyin, ilohiy joylarga sig''ingach tug''ilgan qiz yoki ziyoratchi, toat ibodat qiluvchi, sig''inuvchi qiz','Arabcha');
INSERT INTO "all_names" VALUES (64651,'Zokir','O''g''il bolalar ismi','Yodda saqlovchi, eslovchi','Arabcha');
INSERT INTO "all_names" VALUES (64652,'Zokira','Qiz bolalar ismi','Allohni yodga oluvchi, unga madhu sano aytuvchi qiz yoki xudojo''y qiz','Arabcha');
INSERT INTO "all_names" VALUES (64653,'Zokiriddin','O''g''il bolalar ismi','Dinni madh qiluvchi, dinning yodi bilan yashovchi yoki  xudojo''y bola','Arabcha');
INSERT INTO "all_names" VALUES (64654,'Zokiriyo','O''g''il bolalar ismi','Allohni yodga oluvchi, uning zikri (yodi) bilan yashovchi bola','Arabcha');
INSERT INTO "all_names" VALUES (64655,'Zokirmuhammad','O''g''il bolalar ismi','Muhammad (s.a.v.)ni yod etuvchi, eslovchi bola yoki xudojo''y o''g''il','Arabcha');
INSERT INTO "all_names" VALUES (64656,'Zokirulla','O''g''il bolalar ismi','Allohni eslovchi, uni madh qiluvchi bola','Arabcha');
INSERT INTO "all_names" VALUES (64657,'Zokirxo''ja','O''g''il bolalar ismi','Xo''jalar naslidan bo''lgan xudojo''y, dindor bola','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (64658,'Zol','O''g''il bolalar ismi','Keksa, qari, chol yoki aqlli, dono, ziyrak. bu nom abulqosim firdavsiyning shohnoma asari qahramoni rustamning otasi ismi','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64659,'Zomir','O''g''il bolalar ismi','Nayza sanchuvchi, nayzaboz, qilichboz','Arabcha');
INSERT INTO "all_names" VALUES (64660,'Zorboy','O''g''il bolalar ismi','Zor bo''lib, qumsab yurib, erishilgan bola.','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64661,'Zo''rboy','O''g''il bolalar ismi','Kuchli, qudratli, g''olib, muzaffar','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64662,'Zorliq','O''g''il bolalar ismi','Farzandga muhtoj bo''lib yurib tilab olingan o''g''il','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64663,'Zormas','Qiz bolalar ismi','Bu bolaga hech kim zor emas, uning hech kimga keragi yo''q. bolasi turmasdan o''lavergan oilalarda beriladigan ism','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64664,'Zormuhammad','O''g''il bolalar ismi','Zorlanib, tilab olingan bola muhammad (s.a.v.) ga ummat bo''lsin','Fors-tojikcha, arabcha');
INSERT INTO "all_names" VALUES (64665,'Zo''rmuhammad','O''g''il bolalar ismi','Kuchli, qudratli bo''lib o''ssin yoki muhammad (s.a.v.) ning qudrati, irodasi bo''lgan bola','Fors-tojikcha, arabcha');
INSERT INTO "all_names" VALUES (64666,'Zo''rqul','O''g''il bolalar ismi','Allohning kuchli, jasur bandasi yoki qar. zo''rboy','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64667,'Zo''rxo''ja','O''g''il bolalar ismi','Xo''jalar avlodidan bo''lgan bola qudratli, jasur bo''lib yursin','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64668,'Zovar','Qiz bolalar ismi','Kuchli, qudratli, jasur qiz yoki zuhro yulduzidek go''zal, yorqin qiz','Arabcha');
INSERT INTO "all_names" VALUES (64669,'Zovur','O''g''il bolalar ismi','Ziyorat qiluvchi, (davvar) yoki zohir ismining buzilgan shakli','Arabcha');
INSERT INTO "all_names" VALUES (64670,'Zovura','Qiz bolalar ismi','Ziyoratchi qiz, sig''inuvchi ayol','Arabcha');
INSERT INTO "all_names" VALUES (64671,'Zubarjat','Qiz bolalar ismi','Zabarjad-zangori tusli asiltoshdek bebaho, qimmatli qiz','Arabcha');
INSERT INTO "all_names" VALUES (64672,'Zubayberdi','O''g''il bolalar ismi','Alloh bergan tuhfa, sovg''a , in''om','Arabcha');
INSERT INTO "all_names" VALUES (64673,'Zubayda','Qiz bolalar ismi','Ayollarning eng yaxshisi, a’losi','Arabcha');
INSERT INTO "all_names" VALUES (64674,'Zubaydulla','O''g''il bolalar ismi','Allohning eng yaxshi ko''rgan, tanlangan bandasi. allohning marhamati, muruvvati, tuhfasi. bu nom o''rta asrda musulmonlar tomonidan muhammad (s.a.v.)ga berilgan sifatdir','Arabcha');
INSERT INTO "all_names" VALUES (64675,'Zubayr','O''g''il bolalar ismi','Kuchli, qudratli, aqlli, dono','Arabcha');
INSERT INTO "all_names" VALUES (64676,'Zubayra','Qiz bolalar ismi','Oqila, dono qiz','Arabcha');
INSERT INTO "all_names" VALUES (64677,'Zufar','O''g''il bolalar ismi','G''olib, muzaffar, yengilmas yoki yo''lboshchi, sarkor','Arabcha');
INSERT INTO "all_names" VALUES (64678,'Zufarxo''ja','O''g''il bolalar ismi','Xo''jalar naslidan bo''lgan qudratli, g''olib bola','Arabcha');
INSERT INTO "all_names" VALUES (64679,'Zuhriddin','O''g''il bolalar ismi','Dinning g''olibligi yoki dinning g''olib kishisi','Arabcha');
INSERT INTO "all_names" VALUES (64680,'Zuhro','Qiz bolalar ismi','Nur, yorqin, ravshan. cho''lpon yulduzi. zuhrodek nurli, ko''rkam yoki  baxt-saodat sohibi. zuhro muhammad (sav)ning qizi fotimaning sifati bo''lgan','Arabcha');
