INSERT INTO "all_names" VALUES (64683,'Zuhroxol','Qiz bolalar ismi','Zuhrodek nurli, porloq, saodatmand va xol bilan tug''ilgan qiz','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (64684,'Zuhrulla','O''g''il bolalar ismi','Allohning aniq namoyon bo''lishi yoki alloh qudratining nayomon bo''lishi','Arabcha');
INSERT INTO "all_names" VALUES (64685,'Zuhur','O''g''il bolalar ismi','Paydo bo''lish, yuzaga kelish.','Arabcha');
INSERT INTO "all_names" VALUES (64686,'Zulayho','Qiz bolalar ismi','Turkiy va arab xalqlarida zulayho yoki zeliha ko''rinishida qo''llaniladi va aniq ta''rif berilmaydi. eng yaqin variant forscha zuleyka ismi bo''lib eng chiroyli ma''nosini anglatadi.','Aniq emas');
INSERT INTO "all_names" VALUES (64687,'Zulayna','Qiz bolalar ismi','Jussador, gavdali. musulmonlar adabiyotida yusuf bibliyada iosifning sevgilisi, ma’shuqasi ismi','Arabcha, yahudiycha');
INSERT INTO "all_names" VALUES (64688,'Zulbahor','Qiz bolalar ismi','Bahordek ko''rkam yoki  ko''klam qizi','Arabcha, fors-tojikcha');
INSERT INTO "all_names" VALUES (64689,'Zulbibi','Qiz bolalar ismi','Sarvqomad, xushro''y qiz','Arabcha');
INSERT INTO "all_names" VALUES (64690,'Zulfali','O''g''il bolalar ismi','Alining sochi yoki alining qudrati','Fors-tojikcha, arabcha');
INSERT INTO "all_names" VALUES (64691,'Zulfi','Qiz bolalar ismi','Zulfinisa, zulfiddin ismlarining qisqa  shakli','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64692,'Zulfiddin','O''g''il bolalar ismi','Dinning jingalak sochli, xudojo''y farzandi','Fors-tojikcha, arabcha');
