INSERT INTO "all_names" VALUES (64701,'Zulfiqora','Qiz bolalar ismi','Qora sochli, zebo qiz','Fors-tojikcha, o''zbekcha');
INSERT INTO "all_names" VALUES (64702,'Zulfira','Qiz bolalar ismi','Ajoyib, chiroyli sochli qiz','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64703,'Zulfitilla','O''g''il bolalar ismi','Tilla sochli, jingalak, chiroyli sochli bola','Fors-tojikcha');
INSERT INTO "all_names" VALUES (64704,'Zulfixabira','Qiz bolalar ismi','Jingalak sochli, bilimdon, dono qiz.','Fors-tojikcha, arabcha');
INSERT INTO "all_names" VALUES (64705,'Zulfixon','Qiz bolalar ismi','Jingalak sochli, yoqimtoy, hurmatga sazovor qiz','Fors-tojikcha, o''zbekcha');
