INSERT INTO "all_names" VALUES (64709,'Zulhayot','Qiz bolalar ismi','Tiriklik egasi, ya’ni yashovchi, umri uzoq qiz','Arabcha');
INSERT INTO "all_names" VALUES (64710,'Zulhijja','Qiz bolalar ismi','Hijriy yil hisobining o''n ikkinchi oyi, o''sha oyda tug''ilgan qiz','Arabcha');
INSERT INTO "all_names" VALUES (64711,'Zuljalol','O''g''il bolalar ismi','Buyuk martaba, sharaf egasi','Arabcha');
INSERT INTO "all_names" VALUES (64712,'Zuljamol','Qiz bolalar ismi','Ulug'', qadrli, e’tiborli yoki nafosat sohibi','Arabcha');
INSERT INTO "all_names" VALUES (64713,'Zulkabir','O''g''il bolalar ismi','Salobatli, kelishgan','Arabcha');
