INSERT INTO "all_names" VALUES (64728,'Zunnun','O''g''il bolalar ismi','Ulkan baliq egasi. aqidaga ko''ra yunus payg''ambar uch kun ulkan baliq (kit)ning ichida yashagan. shu sabab unga ushbu laqab berilgan va keyinchalik bu nom kishilar ismiga aylangan','Arabcha');
INSERT INTO "all_names" VALUES (64729,'Zurafo','Qiz bolalar ismi','Nozik did, zaruf fikr egasi yoki go''zal, zebo qiz','Arabcha');
INSERT INTO "all_names" VALUES (64730,'Zurriyot','Qiz bolalar ismi','Pushtipanoh, farzand, ya’ni zurriyot bo''lib orqamizda qolsin','Arabcha');
